INSERT INTO `devset` VALUES (0,'Were Scott Derrickson and Ed Wood of the same nationality?','No, Scott Derrickson and Ed Wood were not of the same nationality. Scott Derrickson is an American filmmaker born in Denver, Colorado, while Ed Wood was also an American filmmaker born in Poughkeepsie, New York.'),(1,'What government position was held by the woman who portrayed Corliss Archer in the film Kiss and Tell?','The woman who portrayed Corliss Archer in the film Kiss and Tell was named Shirley Temple. However, she did not hold a government position. After her career as a child actress, she became involved in politics, serving as a United States Ambassador to Ghana and later Czechoslovakia.'),(2,'What science fantasy young adult series, told in first person, has a set of companion books narrating the stories of enslaved worlds and alien species?','The science fantasy young adult series you may be referring to is the \'Pittacus Lore\'s Lorien Legacies.\' The main series is told in the first person and follows the adventures of a group of alien teenagers with special powers on Earth. The companion books, titled \'Lorien Legacies: The Lost Files,\' narrate the stories of enslaved worlds and alien species.'),(3,'Are the Laleli Mosque and Esma Sultan Mansion located in the same neighborhood?','No, the Laleli Mosque and the Esma Sultan Mansion are not located in the same neighborhood. The Laleli Mosque is located in the Laleli neighborhood in the Fatih district of Istanbul, Turkey, while the Esma Sultan Mansion is located in the Ortakoy neighborhood in the Besiktas district of Istanbul. They are in different districts and not very close to each other.'),(4,'The director of the romantic comedy \'Big Stone Gap\' is based in what New York city?','The director of the romantic comedy film \'Big Stone Gap\' is Adriana Trigiani, who is based in New York City. Trigiani is an American author, television writer, film director, and producer. She was born and raised in Big Stone Gap, Virginia, which served as inspiration for her novel and subsequently the movie.'),(5,'2014 S/S is the debut album of a South Korean boy group that was formed by who?','2014 S/S is the debut album of the South Korean boy group WINNER, which was formed by YG Entertainment through the reality show WIN: Who Is Next in 2013. The group consists of four members: Jinwoo, Seunghoon, Mino, and Seungyoon.'),(6,'Who was known by his stage name Aladin and helped organizations improve their performance as a consultant?','I\'m sorry, but I do not have enough information to answer that question. Can you please provide more details or context so I can provide an accurate response?'),(7,'The arena where the Lewiston Maineiacs played their home games can seat how many people?','The Lewiston Maineiacs played in the Androscoggin Bank Colisée in Lewiston, Maine. The seating capacity of the arena is approximately 3,677 for ice hockey games.'),(8,'Who is older, Annie Morton or Terry Richardson?','Annie Morton is older than Terry Richardson. Annie Morton was born on September 12, 1967, while Terry Richardson was born on August 14, 1965.'),(9,'Are Local H and For Against both from the United States?','Yes, Local H and For Against are both rock bands from the United States. Local H is from Zion, Illinois and For Against is from Lincoln, Nebraska.'),(10,'What is the name of the fight song of the university whose main campus is in Lawrence, Kansas and whose branch campuses are in the Kansas City metropolitan area?','The fight song of the University of Kansas is called \'I\'m a Jayhawk\'.'),(11,'What screenwriter with credits for \'Evolution\' co-wrote a film starring Nicolas Cage and Téa Leoni?','The screenwriter that co-wrote a film starring Nicolas Cage and Téa Leoni is David Diamond. He co-wrote the 2005 comedy film \'The Family Man\'.'),(12,'What year did Guns N Roses perform a promo for a movie starring Arnold Schwarzenegger as a former New York Police detective?','Guns N\' Roses performed a promo for the movie \'The Last Action Hero,\' starring Arnold Schwarzenegger, in 1993.'),(13,'Are Random House Tower and 888 7th Avenue both used for real estate?','Yes, both the Random House Tower and 888 7th Avenue are commercial buildings used for real estate purposes. The Random House Tower is a 52-story high-rise building located in Midtown Manhattan, and it is home to various office spaces, including the headquarters of publishing company Penguin Random House. 888 7th Avenue, also known as the AXA Equitable Center, is another high-rise commercial building located in Midtown Manhattan that houses offices, retail spaces, and restaurants.'),(14,'The football manager who recruited David Beckham managed Manchester United during what timeframe?','The football manager who recruited David Beckham is Sir Alex Ferguson, who managed Manchester United from 1986 to 2013.'),(15,'Brown State Fishing Lake is in a country that has a population of how many inhabitants ?','I\'m sorry but I do not have enough information to accurately answer your question. Can you please provide more details such as the name of the country or the location of Brown State Fishing Lake?'),(16,'The Vermont Catamounts men\'s soccer team currently competes in a conference that was formerly known as what from 1988 to 1996?','The Vermont Catamounts men\'s soccer team currently competes in the America East Conference. From 1988 to 1996, the conference was known as the North Atlantic Conference (NAC).'),(17,'Are Giuseppe Verdi and Ambroise Thomas both Opera composers ?','Yes, Giuseppe Verdi and Ambroise Thomas were both famous opera composers. Verdi was an Italian composer who is one of the most influential opera composers of the 19th century. Some of his most famous works include \'Rigoletto,\' \'La Traviata,\' and \'Aida.\' Ambroise Thomas, on the other hand, was a French composer known for his opera, \'Mignon,\' which was a great success during his time.'),(18,'Roger O. Egeberg was Assistant Secretary for Health and Scientific Affairs during the administration of a president that served during what years?','Roger O. Egeberg was Assistant Secretary for Health and Scientific Affairs during the administration of President Richard Nixon, who served from 1969 to 1974.'),(19,'Which writer was from England, Henry Roth or Robert Erskine Childers?','Robert Erskine Childers was not from England. He was born in Ireland. Henry Roth, on the other hand, was an American writer born in New York City.'),(20,'Which other Mexican Formula One race car driver has held the podium besides the Force India driver born in 1990?','The only other Mexican Formula One race car driver to hold the podium besides the Force India driver born in 1990 (Sergio Perez) is Pedro Rodriguez. He won two races in his Formula One career; the first was the 1967 South African Grand Prix and the second was the 1970 Belgian Grand Prix.'),(21,'This singer of A Rather Blustery Day also voiced what hedgehog?','The singer of \'A Rather Blustery Day\' is Sterling Holloway, who also provided the voice of the character \'Flattie the Hedgehog\' in the 1941 Disney film \'The Reluctant Dragon\'.'),(22,'Aside from the Apple Remote, what other device can control the program Apple Remote was originally designed to interact with?','The program Apple Remote was originally designed to interact with iTunes, and aside from the Apple Remote, iTunes can also be controlled using the keyboard shortcut keys and the media keys found on some keyboards. Additionally, there are several third-party iOS apps that can control iTunes on a Mac, such as the Remote app from Apple, and other apps like Rowmote, Remoteless, and more.'),(23,'Which performance act has a higher instrument to person ratio, Badly Drawn Boy or Wolf Alice? ','Badly Drawn Boy is a solo act and typically performs with only a few instruments such as guitar, piano, and harmonica, so the instrument to person ratio is low. On the other hand, Wolf Alice is a four-piece band that typically performs with multiple instruments including guitar, bass, drums, and keyboard, so the instrument to person ratio is higher. Therefore, Wolf Alice has a higher instrument to person ratio than Badly Drawn Boy.'),(24,'What was the father of Kasper Schmeichel voted to be by the IFFHS in 1992?','Peter Schmeichel, Kasper Schmeichel\'s father, was voted as the World\'s Best Goalkeeper in 1992 by the International Federation of Football History and Statistics (IFFHS).'),(25,'Who was the writer of These Boots Are Made for Walkin\' and who died in 2007?','\'These Boots Are Made for Walkin\'\' was written by Lee Hazlewood, an American singer, songwriter, and record producer. Nancy Sinatra\'s 1966 recording of the song became a hit and helped to establish her career as a singer. Lee Hazlewood passed away in 2007 at the age of 78.'),(26,'The 2011–12 VCU Rams men\'s basketball team, led by third year head coach Shaka Smart, represented Virginia Commonwealth University which was founded in what year?','Virginia Commonwealth University (VCU) was founded on July 1, 1968.'),(27,'Are both Dictyosperma, and Huernia described as a genus?','Yes, both Dictyosperma and Huernia are described as genera in the scientific classification of plants. Dictyosperma is a genus of palms found in the Mascarene Islands and Huernia is a genus of succulent plants found mainly in Africa and Arabia.'),(28,'Kaiser Ventures corporation was founded by an American industrialist who became known as the father of modern American shipbuilding?','Yes, that is correct. The founder of Kaiser Ventures Corporation was American industrialist, Henry J. Kaiser, who is considered the father of modern American shipbuilding.'),(29,'What is the name for the adventure in \'Tunnels and Trolls\', a game designed by Ken St. Andre?','The name for the adventure in \'Tunnels and Trolls\' designed by Ken St. Andre is \'Delver\'s Delight\'.'),(30,'When was Poison\'s album \'Shut Up, Make Love\' released?','Poison\'s album \'Shut Up, Make Love\' was not an official studio album released by the band. Rather, it was a compilation album released in Japan in 1990 featuring a collection of previously released tracks.'),(31,'Hayden is a singer-songwriter from Canada, but where does Buck-Tick hail from?','Buck-Tick is a rock band that hails from Japan. They formed in Fujioka, Gunma in 1983.'),(32,'Which  French ace pilot and adventurer fly L\'Oiseau Blanc','The French ace pilot and adventurer that flew L\'Oiseau Blanc was Charles Nungesser and his co-pilot François Coli. They attempted to fly from Paris to New York non-stop in May 1927 but were lost at sea, and no trace of them or their plane was ever found.'),(33,'Are Freakonomics and In the Realm of the Hackers both American documentaries?','Yes, both Freakonomics and In the Realm of the Hackers are American documentaries. Freakonomics was directed by Seth Gordon and premiered at the Tribeca Film Festival in 2010. In the Realm of the Hackers was directed by Kevin Anderson and released in 2003.'),(34,'Which band, Letters to Cleo or Screaming Trees, had more members?','Screaming Trees had more members than Letters to Cleo. Screaming Trees had five members while Letters to Cleo had four members.'),(35,'Alexander Kerensky was defeated and destroyed by the Bolsheviks in the course of a civil war that ended when ?','The civil war in Russia ended in 1922, with the victory of the Bolsheviks over their opponents, including Alexander Kerensky and his supporters. Kerensky fled the country after his government was overthrown by the Bolsheviks, and he ultimately found asylum in the United States.'),(36,'Seven Brief Lessons on Physics was written by an Italian physicist that has worked in France since what year?','The Italian physicist who wrote Seven Brief Lessons on Physics is Carlo Rovelli. He has been working in France since the year 2000.'),(37,'The Livesey Hal War Memorial commemorates the fallen of which war, that had over 60 million casualties?','The Livesey Hall War Memorial commemorates the fallen of World War II, which had over 60 million casualties.'),(38,'Are both Elko Regional Airport and Gerald R. Ford International Airport located in Michigan?','No, only Gerald R. Ford International Airport is located in Michigan. Elko Regional Airport is located in Nevada.'),(39,'Ralph Hefferline was a psychology professor at a university that is located in what city?','Ralph Hefferline was a psychology professor at San Francisco State University located in San Francisco, California.'),(40,'Which dog\'s ancestors include Gordon and Irish Setters: the Manchester Terrier or the Scotch Collie?','Neither the Manchester Terrier nor the Scotch Collie has ancestors that include Gordon and Irish Setters. However, the breed that does have these ancestors is the Irish Red and White Setter.'),(41,'Where is the company that Sachin Warrier worked for as a software engineer headquartered? ','I\'m sorry, I do not have enough information to answer your question. Could you please provide the name of the company Sachin Warrier worked for?'),(42,'A Japanese manga series based on a 16 year old high school student Ichitaka Seto, is written and illustrated by someone born in what year?','The manga series you are referring to is \'I\'\'s\' and it is written and illustrated by Masakazu Katsura. Katsura was born on December 10, 1962.'),(43,'The battle in which Giuseppe Arimondi lost his life secured what for Ethiopia?','The battle in which Giuseppe Arimondi lost his life was the Battle of Adwa in 1896. Despite the loss of Arimondi, the battle secured Ethiopia\'s independence and ensured that it remained the only African country to avoid colonization by European powers. It was a significant victory for Ethiopia and a turning point in African history.'),(44,'Alfred Balk served as the secretary of the Committee on the Employment of Minority Groups in the News Media under which United States Vice President?','Alfred Balk served as the secretary of the Committee on the Employment of Minority Groups in the News Media under Vice President Hubert H. Humphrey during the administration of President Lyndon B. Johnson.'),(45,'A medieval fortress in Dirleton, East Lothian, Scotland borders on the south side of what coastal area?','The medieval fortress in Dirleton, East Lothian, Scotland borders on the south side of the Firth of Forth.'),(46,'Who is the writer of this song that was inspired by words on a tombstone and was the first track on the box set Back to Mono?','The song you are referring to is \'Tears on My Pillow\' and it was written by Sylvester Bradford and Al Lewis. The version you are referring to, which was the first track on the box set \'Back to Mono,\' is likely the 1961 recording by Little Anthony and the Imperials.'),(47,'What type of forum did a former Soviet statesman initiate?','It\'s unclear which former Soviet statesman and which forum you are referring to. Could you please provide more context or information so I can better assist you?'),(48,'Are Ferocactus and Silene both types of plant?','Yes, Ferocactus and Silene are both types of plant. Ferocactus is a genus of cactus native to North and Central America, while Silene is a genus of flowering plant in the family Caryophyllaceae, commonly known as campion or catchfly.'),(49,'Which British first-generation jet-powered medium bomber was used in the South West Pacific theatre of World War II?','The British first-generation jet-powered medium bomber that was used in the South West Pacific theatre of World War II was the Gloster Meteor.'),(50,'Which year and which conference was the 14th season for this conference as part of the NCAA Division that the Colorado Buffaloes played in with a record of 2-6 in conference play?','The information you are looking for is unclear. Can you please specify which conference and sport you are referring to?'),(51,'In 1991 Euromarché was bought by a chain that operated how any hypermarkets at the end of 2016?','Euromarché was bought by the Carrefour chain in 1991. At the end of 2016, Carrefour operated 12,296 stores, including hypermarkets, supermarkets, convenience stores, and cash & carry outlets, in more than 30 countries worldwide.'),(52,'What race track in the midwest hosts a 500 mile race eavery May?','The race track in the Midwest that hosts a 500 mile race every May is the Indianapolis Motor Speedway, which hosts the famous Indianapolis 500 race.'),(53,'In what city did the \'Prince of tenors\' star in a film based on an opera by Giacomo Puccini?','The city in which the \'Prince of tenors\' starred in a film based on an opera by Giacomo Puccini is Rome. The film is called \'The Great Caruso\' and was released in 1951.'),(54,'Ellie Goulding worked with what other writers on her third studio album, Delirium?','On her third studio album, Delirium, Ellie Goulding worked with several writers and producers, including Max Martin, Ryan Tedder, Greg Kurstin, Carl Falk, Jim Eliot, Starsmith, and Savan Kotecha.'),(55,'Which Australian city founded in 1838 contains a boarding school opened by a Prime Minister of Australia and named after a school in London of the same name.','The Australian city you\'re referring to is Melbourne, and the boarding school you\'re talking about is Melbourne Grammar School. It was opened by Prime Minister Sir James Frederick Palmerston in 1858 and was named after the prestigious London school of the same name.'),(56,'D1NZ is a series based on what oversteering technique?','D1NZ is a drifting series based on the oversteering technique. In oversteering, the rear wheels slip and lose traction, causing the car to slide sideways through a turn. It is a popular motorsport technique used in drifting competitions around the world.'),(57,'who is younger Keith Bostic or Jerry Glanville ?','I\'m sorry, but I don\'t have that information. However, Keith Bostic was born in 1956 and Jerry Glanville was born in 1941, so Bostic is younger than Glanville.'),