ional Park and Garajonay National Park located?','Teide National Park is located on the island of Tenerife in the Canary Islands (Spain), while Garajonay National Park is located on the island of La Gomera in the Canary Islands (Spain) as well.'),(88,'How many copies of Roald Dahl\'s variation on a popular anecdote sold?','I\'m sorry, but I need more specific information about which variation of an anecdote by Roald Dahl you are referring to. Roald Dahl wrote many books, stories, and poems, and without a specific title or context, it\'s hard to provide an accurate answer. Could you please give me more details or the specific title of the work you\'re referring to?'),(89,'What occupation do Chris Menges and Aram Avakian share?','Chris Menges and Aram Avakian both share the occupation of film editor. Additionally, Chris Menges is also a cinematographer and Aram Avakian was a film director.'),(90,'Andrew Jaspan was the co-founder of what not-for-profit media outlet?','Andrew Jaspan was the co-founder of The Conversation, a not-for-profit media outlet that provides independent and unbiased news and analysis on various topics.'),(91,'Which American film director hosted the 18th Independent Spirit Awards in 2002?','John Waters hosted the 18th Independent Spirit Awards in 2002.'),(92,'Where does the hotel and casino located in which Bill Cosby\'s third album was recorded?','Bill Cosby\'s third album \'Why Is There Air?\' was recorded at the Harrah\'s Hotel and Casino in Lake Tahoe, Nevada in the United States.'),(93,'Do the drinks Gibson and Zurracapote both contain gin?','The Gibson is a classic cocktail made with gin and vermouth and is typically garnished with a pickled onion. Zurracapote, on the other hand, is a traditional Spanish drink made with red wine, fruit (such as oranges, lemons, and apples), and sugar. It does not contain gin.'),(94,'In what month is the annual documentary film festival, that is presented by the fortnightly published British journal of litera