lsea Manning is notable for having hacked into the United States military computer network and releasing classified documents to WikiLeaks, which were published on the organization\'s website. Manning was able to access the material because of her security clearance and position as an army intelligence analyst. Manning\'s actions led to a large-scale investigation and prosecution by the U.S. Government, and she was sentenced to 35 years in prison. However, her sentence was later commuted by President Barack Obama, and she was released in 2017 after serving seven years in confinement.'),(2182,' Who was the husband of the prominent Walton family member who died after John died in 2005?','The prominent Walton family member you are referring to is Alice Walton\'s husband, John T. Walton. John Walton died in a plane crash in 2005. He was survived by his wife, Christy Walton, who was not a member of the Walton family but was married to John at the time of his death.'),(2183,'Which facility was founded in Missouri, Discovery Zone or Valentino\'s?','Discovery Zone was actually founded in Missouri. It was a chain of indoor playgrounds for children, with locations throughout the United States in the 1990s. Valentino\'s, on the other hand, is a chain of pizza restaurants that was founded in Lincoln, Nebraska.'),(2184,'Kevin Short had a role as the Jailer in which three-act French opera?','Kevin Short had a role as the Jailer in the three-act French opera \'Dialogues des Carmélites\' by Francis Poulenc.'),(2185,'Armie Hammer stars as Oliver in a film directed by who ?','Armie Hammer played the character of Oliver in the movie \'Call Me by Your Name,\' which was directed by Luca Guadagnino.'),(2186,'What classmate of Tony Hendra is the Director of Research at the Centre for Theoretical Cosmology within the University of Cambridge?','Stephen Hawking was a classmate of Tony Hendra and served as the Director of Research at the Centre for Theoretical Cosmology at the University of Cambridge.'),(2187,'Who is a Brazilian mixed martial artist in the UFC who Namsaknoi Yudthagarngamtorn coached?','The Brazilian mixed martial artist that Namsaknoi Yudthagarngamtorn coached in the UFC is Renan Barao.'),(2188,'what year was the writer of the blog Preposterous Universe born?','The writer of the blog Preposterous Universe is Sean Carroll, and he was born on October 5, 1966.'),(2189,'George Reed was, along with which Drake University player, one of the greatest running backs in CFL history?','George Reed was one of the greatest running backs in CFL history and he was a star player for the Saskatchewan Roughriders. Along with him, the other player from Drake University who was also considered as one of the greatest running backs in CFL history was Johnny Bright.'),(2190,'Siegi Sessler was the restaurateur whose club was frequented by which actress with Welsh ancestry?','Siegi Sessler\'s club, the \'Cafe de Paris\' was frequented by actress Elizabeth Taylor, who had Welsh ancestry on her mother\'s side.'),(2191,'Where is the American honky tonk country band, whose first studio album was Honky Tonks and Cheap Motels, based?','The American honky tonk country band whose first studio album was Honky Tonks and Cheap Motels is called Midland and they are based in Dripping Springs, Texas.'),(2192,'What prominent director worked with Orion Pictures and was born in December of 1935?','The prominent director who worked with Orion Pictures and was born in December of 1935 is Ridley Scott.'),(2193,'In the 1970s, which group acquired this department store group in the United Kingdom whose co-founding director is the father of Lieutenant Colonel Donald Swain Lewis?','In the 1970s, the Burton Group acquired the department store group you are referring to. The co-founding director of the store group was Reginald Lewis, who is the father of Lieutenant Colonel Donald Swain Lewis.'),(2194,'The USS Daedalus was named after an exiled Athenian representative of artists from which culture?','The USS Daedalus was named after the Greek mythological figure Daedalus who was an Athenian craftsman and artist. He was exiled from Athens for killing his nephew and sought refuge in the Kingdom of Crete, where he became a master craftsman and inventor.'),(2195,'Command and Control was a book that discusses the 1980 incident in what state?','The book \'Command and Control\' by Eric Schlosser discusses the 1980 incident at a Titan II missile complex in Arkansas.'),(2196,'Which iPhone was the first to be completely developed by the Chief Executive Officer of Apple who was born in 1960?','The first iPhone completely developed by Apple\'s CEO who was born in 1960 was the iPhone X, which was released in 2017.'),(2197,'Jaclyn Stapp is married to the former frontman of a band that disbanded in what year?','Jaclyn Stapp is married to Scott Stapp, the former frontman of the band Creed, which disbanded in 2004.'),(2198,'Which player is from Brazil, Jimmy Connors or Maria Bueno?','Maria Bueno is from Brazil.'),(2199,'When was the University established where Laura Landweber is a professor ?','Laura Landweber is a professor at Princeton University, which was established in 1746.'),(2200,'Were Basil Dean and Francis Ford Coppola both alive at some point in time?','Yes, Basil Dean and Francis Ford Coppola were both alive at some point in time. Basil Dean was born on September 27, 1888, and passed away on August 7, 1978. Francis Ford Coppola was born on April 7, 1939, and is still alive as of May 2021.'),(2201,'Whitford Lodge once held a branch of the bank that later became which national bank?','Whitford Lodge once held a branch of the bank that later became the National Westminster Bank (NatWest) in the United Kingdom.'),(2202,'Who created the term that the author of A Piece of Danish Happiness uses to explain why Danish people are the happiest in the world?','The term \'hygge\' which the author of A Piece of Danish Happiness uses to explain why Danish people are the happiest in the world was not created by a single person. It is a Danish term that has been a part of the Danish language and culture for centuries. The word \'hygge\' roughly translates to coziness, warm atmosphere, conviviality, and enjoying the good things in life with good people. Hygge is an important part of the Danish way of life and it is often cited as one of the reasons for Denmark\'s high happiness rankings.'),(2203,'How many players are in the club in which Stephen Curry became part of in the 2015-2016 NBA season?','Stephen Curry played for the Golden State Warriors during the 2015-2016 NBA season. There are 15 players on an NBA roster, but teams can also have up to two additional players signed to two-way contracts.'),(2204,'Which magazine has been around longer, Guitar World or Golf Digest?','Golf Digest has been around much longer than Guitar World. Golf Digest was founded in 1950, while Guitar World wasn\'t founded until 1980.'),(2205,'Bride of the Regiment was later remade into a 1948 film starring the actress and pin-up girl who was the highest-salaried American woman in which two years?','The actress and pin-up girl who was the highest-salaried American woman in 1946 and 1947 was Betty Grable, and she starred in the 1948 film remake of \'Bride of the Regiment.\''),(2206,'Did the playwrights Eugène Ionesco and Paul Scott live during the same time period?','Yes, the playwrights Eugène Ionesco and Paul Scott did live during the same time period. Eugène Ionesco was born in Romania in 1909 and died in France in 1994, while Paul Scott was born in England in 1920 and died in 1978. Both were active in the mid-20th century, with Ionesco being a major figure in the Theatre of the Absurd movement, and Scott known for his multi-volume novel series \'The Raj Quartet.\''),(2207,'Svíčková is a dish that includes dumplings that are prepared in what way?','Svíčková is a Czech dish that involves tender beef sirloin served with a creamy sauce made of root vegetables, sour cream, and spices. The dumplings that are traditionally served with Svíčková are called knedlíky, and they are prepared by boiling a mixture of flour, eggs, milk, and yeast into dumpling shapes. The dumplings are then sliced and served alongside the beef and sauce.'),(2208,'North Midland Divisional Engineers took part in a battle during WWII that went on for how many weeks ?','I believe you are referring to the Battle of Kohima in northeast India during World War II. The battle began on April 4, 1944, and lasted for about two weeks, until April 18, 1944.'),(2209,'What Lord of the Rings actor starred alongside Paul Hogan in Flipper?','Elijah Wood is the Lord of the Rings actor who starred alongside Paul Hogan in the 1996 movie Flipper.'),(2210,'Who co-starred in an episode of The ABC Comedy Hour with the man who played Duke Slater in \'Gomer Pyle, U.S.M.C.\'? ','According to IMDb, the actor who played Duke Slater in \'Gomer Pyle, U.S.M.C.\' was Ronnie Schell. He co-starred in an episode of \'The ABC Comedy Hour\' with a variety of performers, so without a specific episode title, it\'s difficult to say who co-starred with him.'),(2211,'Who covered the song I Love You by Chris Write?','The song \'I Love You\' was originally performed by Chris Walker, not Chris Write. It was also covered by the groups Earth, Wind & Fire and Kool & the Gang.'),(2212,'What was the title of the failed magazine that preceded and inspired the The Science Fiction League?','The failed magazine that preceded and inspired The Science Fiction League was called \'The Comet.\' It was published in 1930 by the same publisher as Amazing Stories, which was the official publication of The Science Fiction League. The Comet only lasted for a few issues before folding, but it laid the groundwork for the league\'s formation.'),(2213,'Consider the band formed in 2015 by JYP Entertainment through the reality show \'Sixteen\'. How many tracks are on the reissue of their third album?','The band forme