rama, action, and thriller.'),(2219,'Are Stephen Frears and Jan Švankmajer from the same country?','No, Stephen Frears and Jan Švankmajer are not from the same country. Stephen Frears is a British film director, while Jan Švankmajer is a Czech filmmaker and artist.'),(2220,'Phoebe Ruguru created a 2014 film on a smartphone marketed by what company?','Phoebe Ruguru\'s 2014 film \'Something Necessary\' was shot using a Nokia Lumia 920 smartphone.'),(2221,'The Wright Model B was an early pusher biplane designed by what inventors and aviation pioneers who are credited with building the world\'s first successful airplane?','The Wright Model B was designed by the renowned American inventors and aviation pioneers, Orville and Wilbur Wright. They are credited with building and flying the world\'s first successful airplane, the Wright Flyer, on December 17, 1903.'),(2222,'Kieran Crichlow is a footballer from what island in the Lesser Antilles?','Kieran Crichlow is a footballer from the island of Barbados in the Lesser Antilles.'),(2223,'The home video game console that was developed by Sony Computer Entertainment is a platform for a racing video game developed by who?','The home video game console developed by Sony Computer Entertainment is the PlayStation. There are several racing video games that have been developed for the PlayStation by different video game developers. Can you please provide me with the name of the specific racing video game you are referring to so I can provide a more accurate answer?'),(2224,'What actor from \'Willow\' also starred in \'The Usual Suspects\'?','The actor who starred in both \'Willow\' and \'The Usual Suspects\' is Roan Inish.'),(2225,'What American filmmaker was the co-founder of Troma Entertainment film studio, Stanley Lloyd Kaufman, Jr. or Jay T. Wright?','The American filmmaker who was the co-founder of Troma Entertainment film studio is Stanley Lloyd Kaufman, Jr.'),(2226,'Are Southwest Florida International Airport and Henry E. Rohlsen Airport both in Florida?','No, Henry E. Rohlsen Airport is not in Florida. It is located on the island of St. Croix in the United States Virgin Islands. Southwest Florida International Airport is located in Fort Myers, Florida.'),(2227,'Matt Doheny lost his primary race to what current youngest woman ever elected to Congress?','Matt Doheny lost his primary race to Elise Stefanik. Elise Stefanik is the current youngest woman ever elected to Congress.'),(2228,'Which was released first, Hot Girls Wanted or China Blue?','The documentary \'China Blue\' was released before \'Hot Girls Wanted.\' \'China Blue\' was released in 2005, while \'Hot Girls Wanted\' was released in 2015.'),(2229,'\'Look At Us Now\' is a song by American DJs based in which city ?','I\'m sorry, but I cannot retrieve that information without additional context. Could you please provide the full name of the DJs you are referring to?'),(2230,'Charles Barton \'Chuck\' Kendall, Jr. was reportedly interested in purchasing the Los Angeles Clippers from which Jewish-American businessman?','Charles Barton \'Chuck\' Kendall, Jr. was reportedly interested in purchasing the Los Angeles Clippers from Jewish-American businessman Donald Sterling.'),(2231,'How many episodes were in the season of \'Rick and Morty\' that featured an episode called \'The Ricks Must Be Crazy\'?','The season of \'Rick and Morty\' that featured an episode called \'The Ricks Must Be Crazy\' has a total of 11 episodes. It is the second episode of the second season.'),(2232,'The star of \'Under the Silver Lake\' made his debut in what film?','The star of \'Under the Silver Lake\', Andrew Garfield, made his feature film debut in the 2007 film titled \'Lions for Lambs\'.'),(2233,'Dorian Gray is the main character of what philosophical novel whose editor feared the story was indecent, and deleted roughly five hundred words before publication?','The novel is \'The Picture of Dorian Gray\' written by Oscar Wilde.'),(2234,'Darryl Kubian\'s \'