76,'Mehdi Hashemi was thought to be guilty of opposition to the Iranian regime\'s dealings during what President\'s administration?','Mehdi Hashemi was thought to be guilty of opposition to the Iranian regime\'s dealings during President Ayatollah Khamenei\'s administration in the late 1980s.'),(2377,'What profession does John Landis and Gore Verbinski have in common?','John Landis and Gore Verbinski are both film directors.'),(2378,'How does this series represent a function, which is also used in the Homotopy analysis method?','The series used in the Homotopy Analysis Method (HAM) represents a function in the form of a power series expansion. This expansion is based on a concept of homotopy, where a known problem is transformed into a new problem with adjustable parameters, allowing for a solution to be obtained by a convergent series of functions. \n\nIn HAM, the function to be solved is often represented as a non-linear differential equation or an initial value problem. The power series representation of the solution function is then constructed by assuming it has a polynomial form with unknown coefficients. These coefficients are then determined by solving the associated linear equations obtained by substituting the power series back into the original equation.\n\nThe HAM has proven to be an effective method for solving a wide range of problems in various fields of science and engineering, including mathematical physics, fluid dynamics, astrophysics, and materials science.'),(2379,'Does Il trovatore have less acts than La rondine','No, it\'s actually the other way around. \'Il trovatore\' has four acts, while \'La rondine\' has three acts. \'Il trovatore\' is an opera composed by Giuseppe Verdi, with a libretto by Salvatore Cammarano, and it premiered in Rome in 1853. On the other hand, \'La rondine\' is an opera composed by Giacomo Puccini, with a libretto by Giuseppe Adami and Renato Simoni, and it premiered in Monte Carlo in 1917.'),(2380,'Arizona State Route 51 (SR 51) is named after a Native American woman belonging to what tribe?','Arizona State Route 51 (SR 51) is not named after a specific Native American woman or tribe. According to the Arizona Department of Transportation, the legality of using people\'s names to honor roads was altered in 1984, prohibiting the naming of highways after individuals who are living or who have passed away for less than ten years. SR 51 has its own history of planning and development, but it was not named after any specific person or tribe.'),(2381,'Approximately what percent male is the student body of the University for which the Ouachita Baptist Tigers football program is the intercollegiate American football team?','Without specific information on the University or the football team, I\'m unable to provide an accurate answer. Can you please provide me with the name of the University?'),(2382,'In what city does a Christian minister who won the singles title with Jan Kodes in the 1970 French Open currently reside?','Unfortunately, without additional context or information, it is difficult to answer your question. May I ask if you have a name for this Christian minister?'),(2383,'What country of origin does Traveling Wilburys and Tom Petty have in common?','The Traveling Wilburys and Tom Petty both have their origins from the United States of America.'),(2384,'Which band has more members, Muzzle or Primus?','Primus has more members than Muzzle. Primus is a three-piece band, consisting of Les Claypool, Larry LaLonde and Tim Alexander, while Muzzle generally consists of only two members, Jim and Stephanie Gladstone.'),(2385,'Which dog originated in Galicia, the Bullenbeisser or Can de Palleiro?','The Can de Palleiro is the dog that originated in Galicia. The Bullenbeisser is a breed of dog that originated in Germany.'),(2386,'Come from the Heart:was first recorded by an artist that sang what genre of music?','\'Come from the Heart\' was first recorded by Kathy Mattea, an American country music artist.'),(2387,'Lesley Foxcroft worked with MDF, Card, and which material that is produced by pressing together moist fibres?','Lesley Foxcroft worked with MDF (Medium-density fibreboard), Card and also with a material that is produced by pressing together moist fibres. This material is called \'Pulp Board\' or \'Fibreboard\', which is a type of composite material made from wood fibres and glue.'),(2388,'When is the American politician and attorney which Thomas J. Connolly an for Governor of Maine in 1998 against born ','Thomas J. Connolly was born on December 1, 1948.'),(2389,'Heinrich Marschner was a composer who performed in the time frame after one of the first significant composers in what school of work?','Heinrich Marschner was a composer of the Romantic era. The Romantic era followed the Classical era, which produced significant composers such as Mozart, Haydn, and Beethoven.'),(2390,'What film studio produced both National Treasure and The Computer Wore Tennis Shoes?','Both National Treasure and The Computer Wore Tennis Shoes were produced by Walt Disney Pictures.'),(2391,'BOTH Skyang Kangri and Pumari Chhish are both what?','Skyang Kangri and Pumari Chhish are both mountains located in the Karakoram Range of the Himalayas.'),(2392,'What song from the fourth studio album made by The Who reached No.4 on the UK charts and No. 19 o nthe U.S. \'Billboard\' Hot 100?','The song from The Who\'s fourth studio album that reached No.4 on the UK charts and No. 19 on the U.S. Billboard Hot 100 is \'Pinball Wizard\'.'),(2393,'Julien Kang is the younger brother of the mixed martial artist of what nationality?','Julien Kang is the younger brother of Denis Kang, who is a Canadian mixed martial artist of Korean descent.'),(2394,'Which film was produced first, Dangal or The Man from Snowy River II?','The Man from Snowy River II was produced before Dangal. The Man from Snowy River II was released in 1988, while Dangal was released in 2016.'),(2395,'The Stone Book series is set in what country? ','The Stone Book series was written by Alan Garner, and is set in the United Kingdom, specifically in his birthplace of Cheshire, England.'),(2396,'Are Centaurium and Dacrydium both genuses of plant species?','Yes, Centaurium and Dacrydium are both genera of plant species. \n\nCentaurium is a genus of flowering plants in the gentian family (Gentianaceae), which typically have pink or purple flowers and grow in damp habitats. \n\nDacrydium, on the other hand, is a genus of coniferous trees in the family Podocarpaceae, commonly known as the plum pine family. These trees are mainly found in the Southern Hemisphere, particularly in areas of New Zealand and Australia, with some species also found in South America and Southeast Asia.'),(2397,'Which refers to more breeds, Stabyhoun or Griffon Bruxellois?','Griffon Bruxellois refers to more breeds. There are actually three different breeds within the Griffon Bruxellois category: Griffon Bruxellois, Griffon Belge, and Petit Brabançon. Stabyhoun, on the other hand, refers to a single breed of dog.'),(2398,'What is the name of the statue whose replica have been created in many landmarks world-wide such as near Pont de Grenelle in Paris?','The statue you are referring to is called the Statue of Liberty.'),(2399,'In what year was the Sayrevill, New Jersey rock band that Frankie LaRocka played drums for formed?','The Sayreville, New Jersey rock band that Frankie LaRocka played drums for is called \'John Bongiovi and the Wild Ones,\' later known as \'BonJovi.\' It was formed in 1983.'),(2400,'Which film was directed by Wayne Coles-Janess, Tender Fictions or Bougainville – Our Island Our Fight?','Bougainville - Our Island Our Fight was directed by Wayne Coles-Janess.'),(2401,'What American indie rock group first had Jesse Sandoval as the drummer and now has Jon Sortland on drums?','The American indie rock group that first had Jesse Sandoval as the drummer and now has Jon Sortland on drums is The Shins.'),(2402,'Kenneth L. Gile is the Chief Operating Officer of an airline with its head office in what airport?','I\'m sorry, but I don\'t have enough information to answer that question. Could you please provide me with the name of the airline?'),(2403,'Which industrialist established a museum in Heckscher Park that features \'First Friday\' concerts?','The industrialist who established a museum in Heckscher Park that features \'First Friday\' concerts is Joel Rathbone. The museum is called the Heckscher Museum of Art, and it was founded by August Heckscher in 1920. It was later supported by Joel Rathbone, who helped to grow the museum\'s collection and establish the \'First Friday\' concert series.'),(2404,'Mr. & Mrs. Mxyzptlk is an episode of the superhero TV series that originally aired on what network?','The episode \'Mr. & Mrs. Mxyzptlk\' is from the TV series \'Supergirl\' and originally aired on The CW network.'),(2405,'Which actor starred in Angels in the Outfield, Predator 2, and Places in the Heart?','The actor who starred in Angels in the Outfield, Predator 2, and Places in the Heart is Danny Glover.'),(2406,'Do both Michael Herz, and Roland Emmerich direct comedic horror films?','While Roland Emmerich is known for directing films of a variety of genres, such as action, disaster, and science fiction, he has not directed any comedic horror films as far as my knowledge. On the other hand, Michael Herz is known for co-directing many comedies and horror-comedies with his partner Lloyd Kaufman, such as \'The Toxic Avenger\' series, \'Class of Nuke \'Em High\' series, \'Terror Firmer,\' and many others.'),(2407,'Who is younger, Martin Luther King III or his brother Dexter?','Dexter Scott King is the younger brother of Martin Luther King III.'),(2408,'Which team was older when it had it\'s worst season, The Cleveland Browns or the Detroit Lions','The Detroit Lions were older when they had their worst season. The Lions\' worst season was in 2008 when they finished with a record of 0-16. The team\'s average age that year was 26.3 years old. In comparison, the Cleveland Browns\' worst season was in 2017 when they finished with a record of 0-16. The Browns\' average age that year was 25.8 years old.'),(2409,'What area once connected Great Britain to continental Europe, and is thought to have been submerged around 6,200 BCE by a massive landslide along 290 km of the continental shelf?','The area you are referring to is known as Doggerland, which was once a low-lying land bridge that connected Great Britain to Continental Europe during the last Ice Age. It was submerged around 6,200 BCE due to a massive landslide, which triggered a tsunami that flooded the area.'),(2410,'The Welsh professional footballer Dan Hanford has association with which club that is based in Clitheroe, Lancashire?','Dan Hanford is currently associated with Clitheroe Football Club, which is a semi-professional football club based in Clitheroe, Lancashire, England.'),(2411,'Which is longer, Hampshire and Hampden Canal or Tennessee–Tombigbee Waterway?','The Tennessee-Tombigbee Waterway is longer than the Hampshire and Hampden Canal. The Tennessee-Tombigbee Waterway is approximately 234 miles long while the Hampshire and Hampden Canal is only about 8.5 miles long.'),(2412,'Davey Brozowski is a percussionist for a band that formed in what city in Washington?','Davey Brozowski is a percussionist for the band named \'Modest Mouse\' that formed in Issaquah, Washington.'),(2413,'When did the baseball draft with which Alex Lange was the 30th pick began? ','Alex Lange was selected with the 30th pick in the first round of the 2017 Major League Baseball (MLB) draft. The draft began on June 12, 2017, and lasted for three days, with a total of 40 rounds.'),(2414,'Who starred in her final film role in the 1964 film directed by the man who also did Vera Cruz and Kiss Me Deadly?','That would be the beautiful actress Marilyn Monroe who starred in her final film role in the 19