ized place or city in Oklahoma. Therefore, there is no county seat associated with it.'),(2429,'Bullewijk metro station is part of a mixed rapid transit and light rail system that is how many km long?','The mixed rapid transit and light rail system in which Bullewijk metro station is a part of is called the Amsterdam Metro. Currently, the Amsterdam Metro has a total length of approximately 42.5 kilometers.'),(2430,'SS Ionic was built by the industrial company based in what city?','The SS Ionic was built by the Harland and Wolff shipyard, which was based in Belfast, Northern Ireland.'),(2431,'Which dog breed originates from a region farther east, the Lancashire Heeler or the Russian tracker?','The Russian Tracker breed originates from a region farther east. The Lancashire Heeler breed originated in England, while the Russian Tracker originated in Russia.'),(2432,'Which physicist known for his work on parity violation has a son who became an American chemist teaching at Cornell University?','The physicist known for his work on parity violation who has a son who became an American chemist teaching at Cornell University is named Tsung-Dao Lee. His son is named David Lee, and he was awarded the Nobel Prize in Physics in 1996 for his work on superfluidity in helium-3.'),(2433,'Which band has released more albums with their original members, Sick Puppies or Third Eye Blind?','Sick Puppies has released more albums with their original members than Third Eye Blind. Sick Puppies has released six studio albums with their original members, while Third Eye Blind has released five studio albums with their original members.'),(2434,'who starred in the English-language Danish experimental horror film  which  Lars von Triers received award for ','The English-language Danish experimental horror film you are referring to is \'The House That Jack Built\' (2018), directed by Lars von Trier. The film starred Matt Dillon as the titular character, Jack, alongside Bruno Ganz, Uma Thurman, Si