e scores for many films, including American Beauty. He has been nominated for over fifteen Academy Awards for his work in film music.'),(2952,'What singer-songwriter from Derry appeared on Paul van Dyk\'s 2012 album, Evolution?','The singer-songwriter from Derry who appeared on Paul van Dyk\'s 2012 album \'Evolution\' is Johnny McDaid.'),(2953,'Francisco Mela performed with which American Jazz bassist and singer born in 1984 ?','I think you might be referring to Esperanza Spalding, who was born in 1984 and has performed with Francisco Mela.'),(2954,'Where did Mark Pavelich win Gold in 1980?','Mark Pavelich won a gold medal with the US Men\'s Ice Hockey team in the 1980 Winter Olympics held in Lake Placid, New York. The team famously defeated the heavily-favored Soviet team in what is now known as the \'Miracle on Ice\' game.'),(2955,'The Party Machine with Nia Peeples was executive produced by the talk show host whose show originally ran during what time period?','The Party Machine with Nia Peeples was executive produced by Arsenio Hall, whose talk show \'The Arsenio Hall Show\' originally ran from 1989-1994.'),(2956,'did Robert Wise have more award nominations than Zoltan Korda?','Yes, Robert Wise had more award nominations than Zoltan Korda. Robert Wise was nominated for 38 awards throughout his career, including four Academy Awards, while Zoltan Korda was nominated for 3 awards.'),(2957,'Which band formed first, Swervedriver or Incubus?','Swervedriver formed first. They were formed in England in 1989, while Incubus was formed in California in 1991.'),(2958,'Hugh Milburn Stone stared ina tv series created by what writer?','Hugh Milburn Stone starred in the TV series \'Gunsmoke,\' which was created by writer John Meston along with director Norman Macdonnell.'),(2959,'What was the goal as a photographer of the man whose \'Message from the Interior\' was published by Eakins Press?','The photographer who created \'Message from the Interior\', which was published by Eakins Press, was Edward Weston. The goal of this project was to capture intimate and sensual images of the human body, particularly close-ups of nudes and other details of the human anatomy. Weston sought to explore the relationship between form and texture and to reveal the beauty in even the most mundane and overlooked objects. The photographs included in \'Message from the Interior\' are often abstract and focus on the interplay of light, shadow, and form. Overall, Weston\'s goal was to present a vision of the human body that is both sensual and transcendent.'),(2960,'What is the colloquial name of the professional football team in which striker Frederico Chaves Guedos played? ','Frederico Chaves Guedes, also known as Fred, is a Brazilian footballer who has played for several teams throughout his career. The colloquial name of the professional football team he is most famously associated with is Fluminense, a club based in Rio de Janeiro, Brazil.'),(2961,'Do Dillingham Airport and Rafael Hernández Airport both handle civilian (passenger) service?','Yes, both Dillingham Airport in Hawaii and Rafael Hernández Airport in Puerto Rico handle civilian passenger service. Dillingham Airport primarily serves general aviation and commuter air traffic, while Rafael Hernández Airport serves as a commercial airport that handles both domestic and international flights.'),(2962,' What type of television show did Dylan Everett star in, in 2015?','In 2015, Dylan Everett starred in the television show \'Open Heart\', which was a Canadian teen drama series. He played the role of James Bell, one of the main characters in the show.'),(2963,'What is the species of animal which the town of Antelope, Kansas was named after?','The town of Antelope, Kansas was named after the antelope, which is a mammal species native to the Americas, Africa, and parts of Asia.'),(2964,'The genus containing lions also contains several poorly known what?','The genus containing lions, Panthera, also contains several poorly known big cat species, such as the clouded leopard (Panthera nebulosa), snow leopard (Panthera uncia), and Sunda clouded leopard (Panthera neofelis diardi). These species are relatively less studied and their exact population size and ecology are not yet completely understood.'),(2965,'Which has more species, Sonerila or Scaevola?','There are numerous species of both Sonerila and Scaevola, but Scaevola generally has more species than Sonerila. Scaevola has around 130 species, while Sonerila is estimated to have around 50-60 species.'),(2966,'Stella Maxwell has been a model for a famous fashion shown since when?','Stella Maxwell has been a model for the famous Victoria\'s Secret Fashion Show since 2014.'),(2967,'Which band has the guitarist Gorden Mack, Red House Painters or Daughtry?','Gorden Mack is not a guitarist for either Red House Painters or Daughtry. In Red House Painters, the guitarist is Mark Kozelek, and in Daughtry, the lead guitarist is Josh Steely.'),(2968,'The founder of the Ali Akbar College of Music was known for his virtuosity in what musical instrument?','The founder of the Ali Akbar College of Music, Ali Akbar Khan, was known for his virtuosity in playing the sarod, a stringed musical instrument originating from the Indian subcontinent.'),(2969,'When did the predecessor of The Eyes of Nye first air?','The predecessor of \'The Eyes of Nye\' was a science program called \'Bill Nye the Science Guy,\' which first aired on September 10, 1993.'),(2970,'Camp Courtney was named after the Major killed in action at the battle codenamed what?','Camp Courtney is a United States Marine Corps camp located in Okinawa, Japan, and it was named after the Major Henry A. Courtney Jr. who was killed in action during the Battle of Okinawa in World War II. The battle was codenamed \'Operation Iceberg\'.'),(2971,'what was the birth date of the poker player that wrote \'Super/System\'?','The poker player that wrote \'Super/System\' is Doyle Brunson. He wa