wn for his work on exploitation films such as Coffy, Foxy Brown, and Switchblade Sisters, among others.'),(3175,'The title Grigory Drozd lost in May 2016 was won by a boxer who made his acting debut in what film?','The boxer who won the 2016 boxing match with Grigory Drozd is Tony Bellew. He made his acting debut in the movie \'Creed\' (2015), where he played the role of \'Pretty\' Ricky Conlan.'),(3176,'Special K is a slang word for a medication whose main effects last how long?','I\'m not aware of any medication called \'Special K.\' However, \'Special K\' is a slang term for the drug ketamine, which is used both legally as an anesthetic and illegally as a recreational drug. Its effects can vary depending on the dose and method of administration, but the main effects typically last for 1-2 hours when used recreationally.'),(3177,'Who has more singles titles, Brian Gottfried or Peter Fleming?','Brian Gottfried has more singles titles than Peter Fleming.  Brian Gottfried won 25 singles titles while Peter Fleming won 3 singles titles. However, Peter Fleming was very successful in doubles and mixed doubles competitions, winning 52 doubles titles and 5 mixed doubles titles.'),(3178,'What actor had his final performance in the film based on a dytopian novel by David Eggers called The Circle?','The final performance of actor Bill Paxton was in the film adaptation of the dystopian novel \'The Circle\' by David Eggers. He played the role of the father of the protagonist Mae Holland, portrayed by Emma Watson.'),(3179,'What is the rule that makes a major difference between the National League and the American League that allows another player to bat for the pitcher?','The major difference between the National League and the American League is the designated hitter (DH) rule. In the American League, a designated hitter is used to bat for the pitcher and is allowed in the batting lineup in place of the pitcher. Meanwhile, the National League does not use a designated hitter, and the pitcher must bat for themselves.'),(3180,'Which occupations did Ralph Smart and Trey Parker have in common?','Ralph Smart and Trey Parker did not have any known occupations in common. Ralph Smart is a Nigerian-born British author, speaker, and coach who focuses on spirituality and personal development, while Trey Parker is an American animator, writer, and director who co-created the television show \'South Park.\' Their career paths and professional interests seem to be quite different from each other.'),(3181,'Annapolis Junction is located in what county named after  the wife of Cecilius Calvert, 2nd Baron Baltimore?','Annapolis Junction is located in Howard County, Maryland, which is named after John Eager Howard, a Revolutionary War officer and the fifth governor of Maryland. It is not named after the wife of Cecilius Calvert, 2nd Baron Baltimore.'),(3182,'Somebody’s Daughter’s star Max Gail was most widely known for his role in what other television series?','Max Gail is widely known for his role as Detective Stan Wojo in the television series Barney Miller.'),(3183,'What production company is owned by the director of \'She Hate Me\'?','The production company owned by the director of \'She Hate Me\' is called \'40 Acres and a Mule Filmworks\'. The director, Spike Lee, founded the company in 1986.'),(3184,'Which band has been around longer Catfish and the Bottlemen or The Lumineers?','The Lumineers have been around longer than Catfish and the Bottlemen. The Lumineers were formed in 2005 in Denver, Colorado, while Catfish and the Bottlemen were formed in 2007 in Llandudno, Wales.'),(3185,'Ross Pople worked with which English composer known for his opera \'The Midsummer Marriage\'?','Ross Pople is an English conductor who has worked with a number of composers, but the composer who is most associated with the opera \'The Midsummer Marriage\' is Sir Michael Tippett. Ross Pople has conducted performances of Tippett\'s music, including \'The Midsummer Marriage\', with several different orchestras.'),(3186,'The American rock band from Ukiah, California in which Davey Havok and Adam Carson participate has made how many live albums?  ','Davey Havok and Adam Carson are members of the American rock band AFI (A Fire Inside). They have released three live albums: \'For All the Feeling Eternal,\' \'I Heard a Voice,\' and \'Live at the 9:30 Club.\''),(3187,'Which was published first Timothy McSweeney\'s Quarterly Concern or Scrye?','Timothy McSweeney\'s Quarterly Concern was published first. It was first published in 1998, while Scrye was first published in 1993.'),(3188,'Michael Braz completed a libretto for what Georgia college, founded in 1906?','Michael Braz completed a libretto for Armstrong State University, now known as Georgia Southern University, which was founded in 1906 in Savannah, Georgia.'),(3189,'József Viola\'s association was most prominent with which professional Italian football club in Turin, Piedmont?','József Viola\'s association was most prominent with football club Juventus in Turin, Piedmont.'),(3190,'Which is in the family Rutaceae, the Diplolaena or the Arenaria?','The Diplolaena is in the family Rutaceae and the Arenaria is in the family Caryophyllaceae.'),(3191,'What profession does Nora Roberts and Elizabeth Hardwick have in common?','Nora Roberts and Elizabeth Hardwick are both famous American authors. Nora Roberts is known for writing romance novels and Elizabeth Hardwick was a writer, literary critic, and essayist.'),(3192,'When was the designer of the Disneyland attraction with variants in California, France, Hong Kong, Tokyo, and the Tomorrowland Speedway born?','The designer of the Disneyland attraction with variants in California, France, Hong Kong, Tokyo, and the Tomorrowland Speedway was named John Hench. He was born on June 29, 1908, in Cedar Rapids, Iowa.'),(3193,'At what intersection was the former home of the wooden roller coaster now located at Six Flags Great America in Gurnee, Illinois