wn as The Golden Compass in North America was recorded by Listening Library, a division of Random House Audio, a subsidiary of Penguin Random House, which is a British company.'),(3273,'Jean Hudson Boyd is known for her controversial sentencing of Ethan Couch. What was his sentence?','In 2013, Ethan Couch, a 16-year-old, was sentenced to 10 years of probation after killing four people in a drunk driving accident. The sentence was controversial because his defense used the \'affluenza\' defense, arguing that Couch\'s privileged upbringing led to a sense of entitlement and a lack of responsibility. The presiding judge, Jean Hudson Boyd, was criticized for what some saw as a light sentence.'),(3274,'Follow the Yellow Brick Road Tour is taking place to commemorate the album that was recorded where?','The album \'The Wiz: The Super Soul Musical \'Wonderful Wizard of Oz\'\' was recorded in 1978 for the movie \'The Wiz\'. The \'Follow the Yellow Brick Road Tour\' commemorates the 40th anniversary of the film.'),(3275,'Gabriela Mistral and Alan Sillitoe were both in what profession?','Gabriela Mistral was a poet, educator, and diplomat from Chile. Alan Sillitoe was a novelist and poet from England.'),(3276,'Were Shadows Over Camelot and Battle Sheep released by the same publisher?','No, Shadows Over Camelot and Battle Sheep were not released by the same publisher. Shadows Over Camelot was published by Days of Wonder while Battle Sheep was published by Blue Orange Games.'),(3277,'Which game can have more players, The Magic Labyrinth or Shogun?','Shogun can have more players than The Magic Labyrinth. The Magic Labyrinth is designed for 2-4 players, while Shogun is designed for 3-5 players.'),(3278,'What is the southern border of the neighborhood that the Bruce Silverstein Gallery is located in?','The Bruce Silverstein Gallery is located in the Chelsea neighborhood of Manhattan, so the southern border of the neighborhood would be 14th Street.'),(3279,'How many Golden Globe Awa