hurch of St. Mary of Blachernae are located in Istanbul, Turkey.'),(3309,'What is represented on the cover art of the studio album that includes the song \'Speed of Sound\'?','The studio album that includes the song \'Speed of Sound\' is called \'X&Y\' and its cover art features a collection of multicolored blocks arranged in a grid pattern.'),(3310,'Kentucky Truck Assembly and Louisville Assembly Plant are two auto factories in the city of Louisville operated by which car maker?','Both Kentucky Truck Assembly and Louisville Assembly Plant are operated by Ford Motor Company.'),(3311,'Which team did Joe Buck\'s father broadcast for?','Joe Buck\'s father, the late Jack Buck, was a legendary sportscaster who primarily broadcasted for the St. Louis Cardinals for over four decades. He also worked for CBS Sports and called numerous major events, including 17 Super Bowls and several World Series.'),(3312,'In which year was this single by Cher, written by  Brian Higgins and included in the album The Very Best of Cher, released?','I believe you\'re referring to the song \'Believe\' by Cher. It was released in 1998 as the lead single from her twenty-second studio album \'Believe.\' The song was written by Brian Higgins, Stuart McLennen, Paul Barry, Steven Torch, Matthew Gray, and Timothy Powell.'),(3313,'Who was known for playing a fictionalized version of the wild politician who was the face of communist scare tact\'s in the early 1950\'s?','That would be actor Bryan Cranston, who portrayed the character of Dalton Trumbo in the 2015 biographical drama film \'Trumbo.\' Trumbo was a screenwriter who was blacklisted and jailed for his alleged ties to the communist party during the McCarthy era in Hollywood.'),(3314,'Which breed of dog came first, the Norrbottenspets or the Blue Lacy?','The Norrbottenspets is an ancient breed that originated in Sweden and has been around for centuries. On the other hand, the Blue Lacy is a newer breed that originated in the United States in the mid-19th century. Therefore, the Norrbottenspets came first.'),(3315,'Which wrestler, who died in 2009, featured on the wrestling show Starrcade?','The wrestler who died in 2009 and featured on the wrestling show Starrcade was \'Dr. Death\' Steve Williams.'),(3316,'What character did the actor born on January 19, 1944 play in \'As the World Turns?\'','The actor born on January 19, 1944, is Robert Palmer Watkins. However, he did not appear in \'As the World Turns.\' It\'s possible that you are referring to a different actor or a different show.'),(3317,'What giant silverware company was started as a religious Utopian group and was for many years run by Pierrepont Noyes?','The giant silverware company that was started as a religious Utopian group and was for many years run by Pierrepont Noyes is called Oneida Limited. It was founded in 1848 in Oneida, New York as a religious commune, and in the 1880s, it became a major producer of silverware. Pierrepont Noyes was the leader of the Oneida commune and later became the company\'s president.'),(3318,'Who was born first out of Arnel Pineda and Trace Cyrus?','Trace Cyrus was born first. He was born on February 24, 1989, while Arnel Pineda was born on September 5, 1967.'),(3319,'How large of the area is the nature reserve south of Seacroft Esplanade?','I\'m sorry, I don\'t have access to the specific information you are asking for. Can you please provide more context or details about the nature reserve?'),(3320,'Richard Burton became involved in a mayoral campaign for a politician that previously served as the Mayor of Baltimore during what time period?','Richard Burton became involved in the mayoral campaign for politician William Donald Schaefer, who had previously served as the Mayor of Baltimore from 1971 to 1987.'),(3321,'The Dying Swan is a famous solo associated with Anna Pavlova. Whose music is it based on?','The music for The Dying Swan was composed by Camille Saint-Saëns. It was originally a part of a larger musical work called The Carnival of the Animals.'),(3322,'The star of \'The Inkwell\' also starred in what 1993 movie as O-Dog?','The star of \'The Inkwell\' is Jada Pinkett Smith, who did not appear in the 1993 movie \'The Inkwell.\' However, the actor who starred as O-Dog in that year was Larenz Tate, in the movie \'Menace II Society\'.'),(3323,'What Estonian composer whose music is partly inspired by Gregorian chant set the Latin text of the Magnificat canticle in 1989?','Arvo Pärt is the Estonian composer who set the Latin text of the Magnificat canticle in 1989. His music is indeed partly inspired by Gregorian chant.'),(3324,'Which is a type of gun dog, the Labrador Retriever or the Tibetan Terrier?','The Labrador Retriever is a type of gun dog. The Tibetan Terrier, on the other hand, is not typically classified as a gun dog, but instead is sometimes categorized as a companion or non-sporting breed.'),(3325,'In which professional wrestling promotion did Randy Savage perform, after he left the World Wrestling Federation?','After leaving the World Wrestling Federation (WWF, now WWE), Randy Savage joined World Championship Wrestling (WCW) in 1994 where he became a multiple-time champion before retiring from in-ring competition in 2000.'),(3326,'Leonard Logsdail had a cameo role in the biographical film directed by whom?','Leonard Logsdail had a cameo role in the biographical film \'McQueen\' directed by Ian Bonhôte and Peter Ettedgui in 2018.'),(3327,'Are Super High Me and All in This Tea both documentaries?','Yes, both Super High Me and All in This Tea are documentaries. Super High Me is a documentary about the effects of marijuana on the human body, while All in This Tea is a documentary about the world of Chinese tea and tea culture.'),(3328,'What day of the week does the Korean cooking-variety program featuring the owner of \'Dear. bread\' air?','I\'m sorry but I do not have access to the latest TV schedule. However, you can try to search for the show\'s name or the network that airs it and check their programming schedule for the day and time that it is broadcasted.'),(3329,'Which Hells Angel member stabbed and beat an attendant of the 1969 counterculture-era rock concert in the United States?','The Hells Angel member who stabbed and beat an attendant of the 1969 counterculture-era rock concert in the United States was Alan Passaro. He killed Meredith Hunter during a performance by The Rolling Stones at the Altamont Free Concert in December 1969.'),(3330,'In which Sottish Region is the castle in which] Sir Roger de Kirkpatrick was born ?  ','Sir Roger de Kirkpatrick was born in the Scottish Region of Dumfries and Galloway.'),(3331,' How many acres did this plantation consist of, in which the Honourable The Irish Society was set up to colonise County Londonberry? ','The plantation in which the Honourable The Irish Society was set up to colonize County Londonderry (also known as Derry), consisted of approximately 120,000 acres.'),(3332,'What airline holding company located in Solna Municipality, Sweden owns a technical aircraft maintenance company located in Arlanda, Sweden?','The airline holding company located in Solna Municipality, Sweden that owns a technical aircraft maintenance company located in Arlanda, Sweden is SAS AB (Scandinavian Airlines System). The technical aircraft maintenance company is called SAS Technical Services.'),(3333,'Lighthouse Beach is a small section of the Fire Island National Seashore that is adjacent to a state park in Long Island that is how big?','Lighthouse Beach is actually part of the Fire Island National Seashore, which is adjacent to Robert Moses State Park on Fire Island. Robert Moses State Park is about 875 acres in size.'),(3334,'What party campaigned for the Irish Home Rule Movement?','The Irish Home Rule Movement was mainly supported by the Irish Parliamentary Party led by Charles Stewart Parnell in the late 19th and early 20th century. Its aim was to secure self-government for Ireland within the United Kingdom.'),(3335,'The winner of the the London Riders\' Championship in 1953 scored how many points in the 1952 Individual Speedway World Championship?','Unfortunately, I do not have access to the complete statistics about the London Riders\' Championship in 1953. However, I can tell you that in the 1952 Individual Speedway World Championship, the winner was Jack Young from Australia with a score of 14 points out of a possible 15.'),(3336,'Which of the following was founded in 2003: University of Arizona or Presbyterian University College?','Neither the University of Arizona nor the Presbyterian University College was founded in 2003. The University of Arizona was founded in 1885, whereas the Presbyterian University College was founded in Ghana in 2003.'),(3337,'Which opera had more contributions to its making from friends of the composer of the opera, Eugene Onegin or The Devil and Kate?','Eugene Onegin, an opera by Pyotr Ilyich Tchaikovsky, had more contributions to its making from friends of the composer. Tchaikovsky\'s close friend, Konstantin Shilovsky, provided the libretto for the opera, and another friend, Aleksandr Dargomyzhsky, advised him on the musical treatment of the text. Additionally, the famous singer Yelizaveta Lavrovskaya, who was also a friend of Tchaikovsky, played a significant role in shaping the role of Tatiana. In contrast, The Devil and Kate, an opera by Antonín Dvořák, was largely a product of the composer\'s own creative vision, without significant contributions from his friends or colleagues.'),(3338,'What did the NBA player who visited Tlacote el Bajo win during his rookie season?','I\'m sorry, I do not have enough information to answer your question. Can you please provide the name of the NBA player you are referring to?'),(3339,'What musician is ranked 9th in the Top 100 Greatest Metal Guitarists and started a band in 1990 in Los Angeles, California?','The musician ranked 9th in the Top 100 Greatest Metal Guitarists and started a band in 1990 in Los Angeles, California is known to be Nick Bowcott, who was the lead guitarist of the band named Grim Reaper.'),(3340,'What film adaptation do both Jerome Bernard and Ira Lewis have in common?','Both Jerome Bernard and Ira Lewis have the film adaptation \'The Boys from Brazil\' in common.'),(3341,'Which American novelist was notable primarily for publishing science fiction, Allen Drury or Philip K. Dick?','Philip K. Dick was notable primarily for publishing science fiction, whereas Allen Drury was a novelist who mostly wrote political and dramatic fiction, such as the Pulitzer Prize-winning book \'Advise and Consent.\''),(3342,'Who was the director of the film featuring the character \'Supah Ninjas\'?','The live-action television series \'Supah Ninjas\' was created by Leo Chu and Eric Garcia for Nickelodeon. The show was produced by Brian Robbins and Sharla Sumpter Bridgett under their production company, Varsity Pictures. The series did not have a single director, but each episode was directed by a different director.'),(3343,'How many European Jews died in the catastrophe of which Eva Hayman is a survivor?','Eva Hayman was a child survivor of the Holocaust, which was a genocide of European Jews during World War II. Approximately 6 million European Jews died during the Holocaust, along with millions of other victims, including Romani people, disabled individuals, homosexuals, and political dissidents.'),(3344,'Where is the location of Liberty Square park in Disneyland California?','I\'m sorry, but there is no Liberty Square in Disneyland in California. However, there is a Liberty Square in Magic Kingdom, which is located in Walt Disney World Resort in Florida.'),(3345,'What was the occupation of the man who founded the Huffman Historic District which is a part of the Historic Inner East neighborhood in Dayton, Ohio, Unoited States?','Benjamin Huffman, the man who founded the Huffman Historic District, was a businessman and entrepreneur in Dayton, Ohio during the late 19th and early 20th centuries. He made his fortune by investing in real estate and building homes in the inner-city areas of Dayton. The Huffman Historic District was named in honor of him because of his significant contributions to the development of the area.'),(3346,'Brinckerhoff, New Yorkhad a role in a CBS sitcom created by whom?','The CBS sitcom called \'The King of Queens\' that aired from 1998 to 2007 had an episode where Brinckerhoff, New York was mentioned. The sitcom was created by Michael J. Weithorn and David Litt.'),(3347,'Panna a netvor is a re-telling of a classic tale by what novelist?','The novel \'Panna a Netvor\' is a retelling of the classic fairy tale \'Beauty and the Beast\'. It was written by the Czech author Gabriela Preissová.'),(3348,'What group released a song called \'Stinkfist\' on September 17, 1996?','The group that released the song \'Stinkfist\' on September 17, 1996 is Tool.'),(3349,'Is Velvetpark or Shape magazine written more for a lesbian and queer-identified female readership?','Velvetpark Magazine is specifically designed for lesbian, queer, and bisexual women, so it is more catered to this audience compared to Shape magazine, which caters to a broader audience that includes both men and women. While Shape does cover health and fitness topics that may interest LGBTQ+ women, it is not explicitly marketed towards the lesbian and queer-identified female readership.'),(3350,'What concert tour headlined by Coal Chamber in 1999 was named after the popular hit song by the Puerto Rican singer Ricky Martin, spanish for \'the crazy life\'?','The concert tour headlined by Coal Chamber in 1999 that was named after the popular hit song by Ricky Martin is called \'Livin\' La Vida Loca\'.'),(3351,'Where was one of the runners born who almost broke Craig Virgin\'s Illinois Boys Cross Country record?','I am not sure which specific runner you are referring to, but Craig Virgin\'s Illinois Boys Cross Country record was set in 1972 with a time of 13:50.6 for the three-mile race.'),(3352,'Which genus of flowering plant is found in an environment further south, Crocosmia or Cimicifuga?','Crocosmia is generally found in environments further south than Cimicifuga. Crocosmia is native to southern Africa, while Cimicifuga is native to North America and parts of Asia.'),(3353,'Are both the flowering plants Desfontainia and Alisma  in the family Potaliaceae?','No, the flowering plants Desfontainia and Alisma belong to different families. Desfontainia is in the family Columelliaceae, while Alisma is in the family Alismataceae.'),(3354,'How many people go through the airport where Darwin Airline\'s headquarters are located?','Darwin Airline\'s headquarters are located in Lugano Airport in Switzerland. According to the official website of Lugano Airport, the airport handled approximately 212,000 passengers in 2019. However, due to the COVID-19 pandemic, the number of passengers has significantly decreased in 2020.'),(3355,'Who voices the character that stars in Baseball Bugs?','The character that stars in Baseball Bugs is Bugs Bunny and he is voiced by the legendary voice actor, Mel Blanc.'),(3356,'Between two scientists Ernst Messerschmid and Philippe Perrin, who is older?','Ernst Messerschmid is older than Philippe Perrin. Ernst Messerschmid was born on May 21, 1945, while Philippe Perrin was born on January 31, 1963.'),(3357,'Who was born first, Grigory Margulis or Leonid Levin?','Grigory Margulis was born first, on February 24, 1946. Leonid Levin was born on October 10, 1948.'),(3358,'Between two bands, Mastodon and Hole, which one has more members?','Mastodon has more members than Hole. Mastodon is a heavy metal band from Atlanta, Georgia, consisting of four members: Troy Sanders, Brent Hinds, Brann Dailor, and Bill Kelliher. Hole was a rock band from Los Angeles, California, consisting of three main members: Courtney Love, Eric Erlandson, and Melissa Auf der Maur.'),(3359,'Are the Prince of Wales and Flaming beverage both non-alcoholic drinks?','No, the Prince of Wales is a cocktail that typically contains gin, lemon juice, Dubonnet, and bitters, and the Flaming beverage refers to a type of cocktail that is often made with alcohol, such as rum or whiskey, and the drink is set on fire before being served.');
INSERT INTO `devset` VALUES (3360,'What Major League Soccer team owned by Anthony Precourt is coached by a retired American soccer player ?','The Major League Soccer team owned by Anthony Precourt that is coached by a retired American soccer player is the Columbus Crew SC. The current head coach is Caleb Porter, who played professional soccer in the United States and later moved into coaching after retiring as a player.'),(3361,'Which novelist was educated in London, C. S. Forester or Helen Zahavi?','C. S. Forester was educated in London. Helen Zahavi was born in Birmingham and studied at the University of Sussex.'),(3362,'What community in Imperial County, California is partly named after a species of tree that is native to North America, Europe, and western Asia?','The community in Imperial County, California that is partly named after a species of tree that is native to North America, Europe, and western Asia is \'El Centro\'. \'Centro\' means \'center\' in Spanish and \'El Centro\' means \'The Center\' because it is located near the center of the Imperial Valley. The city is partially named after the Desert Cottonwood tree (populus fremontii), which is a common tree species found with the Salton Sea Basin\'s river and creek systems.'),(3363,'Are both Trace Cyrus and Jizzy Pearl vocalists?','Yes, both Trace Cyrus and Jizzy Pearl are vocalists. Trace Cyrus is known for being the lead vocalist of the band Metro Station, while Jizzy Pearl is a singer who has performed with multiple rock bands, including Love/Hate and L.A. Guns.'),(3364,'Carroll County, for 12 of the 13 counties, were named for which wealthy Maryland planter?','Carroll County was named after Charles Carroll of Carrollton.'),(3365,'The Curaçao Centre for Correction and Detention changed its name to Sentro di Detenshon i Korekshon Kòrsou at this event which saw the dissolution of a Caribbean country on what date?','I\'m sorry, but the information you provided is not accurate or complete. The Curaçao Centre for Correction and Detention is still operational under the same name. Additionally, no Caribbean country has dissolved recently. Can you please double-check your question or provide more context so I can assist you better?'),(3366,'To which place was this Irish convict portrayed by Oscar Redding in \'Van Diemen\'s Land\' transported for theft?','The Irish convict portrayed by Oscar Redding in \'Van Diemen\'s Land\' was transported to Tasmania (then known as Van Diemen\'s Land) for theft.'),(3367,'Were Joss Whedon and Norman Mailer both Americans?','Yes, Joss Whedon and Norman Mailer were both Americans. Joss Whedon is a filmmaker, screenwriter and television producer, best known for producing the television series Buffy the Vampire Slayer and The Avengers movie franchise. Norman Mailer was a writer, journalist and filmmaker, best known for his award-winning novel, The Naked and the Dead.'),(3368,'Who is the director of Hollywood film \'7th Heaven\' (1927), Jerry Belson or  Frank Borzage?','The director of the Hollywood film \'7th Heaven\' (1927) was Frank Borzage.'),(3369,'What type of film is Jordan Roberts 2017 film release?','Jordan Roberts\' 2017 film release is \'Burn Your Maps.\' It\'s a drama-comedy film that follows the story of an eight-year-old boy who believes he is a Mongolian goat herder and plans to travel to Mongolia to fulfill his dream.'),(3370,'Though one castle is on an Isle and the other on a ridge, what to they share in common regarding their locations? ','Without knowing which castles you are referring to, I can only provide a general answer. Castles on isles and ridges often have strategic locations for defense purposes. They both provide natural barriers that make it difficult for attackers to approach or invade. Additionally, both locations may provide a vantage point that allows for surveillance of the surrounding area.'),(3371,'Which movie used more styles of animation and filming, James and the Giant Peach or Tangled ?','While both James and the Giant Peach and Tangled utilized multiple forms of animation, Tangled used a more extensive range of techniques such as the traditional hand-drawn animation, computer-generated animation, and watercolor painting. Tangled also utilized live-action filming to capture the actors\' performances, which was later used as reference material for animators. So, Tangled used more styles of animation and filming compared to James and the Giant Peach.'),(3372,'The elder sister of Darleen Carr is best known for her role as which Von Trapp daughter in \'The Sound of Music?\'','The elder sister of Darleen Carr is Charmian Carr, and she is best known for her role as Liesl Von Trapp in \'The Sound of Music.\''),(3373,'Arthur Noss was a gunner for the commader during which two European theatre battles in WWII?','Arthur Noss was a gunner for the commander during the battles of Normandy and the Hurtgen Forest in the European theater during World War II.'),(3374,'Which genus has more species, Lantana or Silybum?','The genus Lantana has more species than the genus Silybum. Lantana has around 150 different species, while Silybum has only two known species.'),(3375,'Hey Ya is a song performed on The Ed Sullivan Show on CBS by which hip hop artist in 2003?','\'Hey Ya!\' is a song by the American hip hop artist and rapper Andre 3000 of the duo Outkast. It was performed on The Ed Sullivan Show on CBS in 2003.'),(3376,'The people for whom pap is a staple food speak a language that is a major branch of what language family?','The people for whom pap is a staple food can refer to several different ethnic groups in various parts of the world. However, many of them are located in sub-Saharan Africa, where the major language families include Niger-Congo, Nilo-Saharan, and Afro-Asiatic. It is therefore likely that the language spoken by these communities is a part of one of these language families. Without more specific information, it is difficult to pinpoint the particular language family.'),(3377,'The 2014 Baylor Bears football games were played at the stadium whose name was changed during what month?','The name of the stadium was changed to McLane Stadium in August 2014, just before the start of the 2014 football season.'),(3378,'What items are used to play both Lapta and Rounders?','Both Lapta and Rounders are bat and ball games that require a bat and a ball to play. The size and materials of the bat and ball may vary between the two games, but the basic equipment is the same. In Lapta, a wooden stick or bat is used to hit a leather ball, while in Rounders, a round, lightweight bat is used to hit a smaller, firmer ball made of rubber or cork.'),(3379,'Who died more recently, Lincoln Steffens, or Monique Wittig?','Monique Wittig died more recently than Lincoln Steffens. Monique Wittig, a French author and feminist theorist, passed away on January 3, 2003, while Lincoln Steffens, an American political journalist, died on August 9, 1936.'),(3380,'What movie directed by Tim Fywell, included the actress who also appeared in \'Euro Trip\' and \'Inspector Gadget\'?  ','The movie directed by Tim Fywell that included the actress who also appeared in \'Euro Trip\' and \'Inspector Gadget\' is \'Mermaids\' (2003), starring Christina Ricci.'),(3381,'Brad Elterman is a professional photographer who addressed the rock \'n\' roll lifestyle of a band that became noted for what?','Brad Elterman is a professional photographer who is well-known for capturing the rock \'n\' roll lifestyle of various musicians and bands, including The Runaways, a teenage all-girl rock band that became noted for paving the way for women in rock music. Brad Elterman photographed The Runaways extensively during their early years in the 1970s, capturing their wild and rebellious energy both on and off stage.'),(3382,'Who wrote lyrics for both \'Little Shop of Horrors\' and the song \'Be Our Guest?\' ','The lyrics for both \'Little Shop of Horrors\' and the song \'Be Our Guest\' were written by Howard Ashman.'),(3383,'In which city have Gary Ayres and Neil Craig both been head coach of the Crows?','Gary Ayres and Neil Craig have both been head coach of the Adelaide Crows in the city of Adelaide, South Australia.'),(3384,'Which team did Art Briles lead to a victory at the Orlando Citrus Bowl on December 29, 2015?','Art Briles led the Baylor Bears football team to a victory at the Orlando Citrus Bowl on December 29, 2015.'),(3385,'Having written singles for several country acts, including Randy Travis, Blake Shelton, and Keith Whitley, what singer song writer achieved his 3rd No 1 single by writing \'Always and Forever\'?','The singer-songwriter who achieved his 3rd No. 1 single by writing \'Always and Forever\' is country music legend, John Denver. The song was released in 1974 and became a massive hit, reaching No. 1 on the Billboard Hot Country Songs chart. It has since become one of Denver\'s most beloved songs and is regarded as a classic of the genre.'),(3386,'Which group of outlaws from the 1890s shares a name with a Yugoslav rock band?','The group of outlaws from the 1890s that shares a name with a Yugoslav rock band is \'The Younger Brothers\'. The Yugoslav rock band with the same name (in Serbian, Mlađi Braca) was formed in 1970.'),(3387,'Which of the following buildings was designed by SHoP Architects: 247 Cherry or General Motors Building?','247 Cherry was designed by SHoP Architects. The General Motors Building was designed by Edward Durell Stone.'),(3388,'In which U.S. state are MedStar Georgetown University Hospital and Providence Hospital?','MedStar Georgetown University Hospital and Providence Hospital are both located in Washington D.C., which is not a U.S. state but rather a federal district.'),(3389,'A celebrity magazine that has featured Snoop Dogg and footballers such as Riyad Mahrez and the creator\'s team-mate Juan Mata was launched by which former Manchester United player?','The celebrity magazine that has featured Snoop Dogg and footballers such as Riyad Mahrez and the creator\'s team-mate Juan Mata was launched by former Manchester United player Patrice Evra. The magazine is called \'The Players\' Tribune.\''),(3390,'Who was born more recently, Billy Corgan or Jeff Martin?','Jeff Martin was born more recently than Billy Corgan. Billy Corgan was born on March 17, 1967, while Jeff Martin was born on October 2, 1969.'),(3391,'Of Mehran University of Engineering and Technology or University of Debrecen which is in Pakistan?','Mehran University of Engineering and Technology is in Pakistan. University of Debrecen is located in Hungary.'),(3392,'What movie studio produced The Benchwarmers, which starred Rob Schneider and Napoleon Dynamites lead actor, Jon Heder?','The production company behind The Benchwarmers is Revolution Studios.'),(3393,'What kind of musician does Robert Plant discography and John Bonham have in common?','Robert Plant and John Bonham are both part of the legendary rock band Led Zeppelin. They were the lead singer and drummer, respectively, for the band. Led Zeppelin released numerous successful albums, and their music is still widely popular today.'),(3394,'What is the name of the city located near the historical region known as Margianḗ in Greek?','The city located near the historical region known as Margianḗ in Greek is called Mary. It is located in present-day Turkmenistan.'),(3395,'What languages did the son of Sacagawea speak?','Sacagawea\'s son, Jean Baptiste Charbonneau, was born in 1805 and grew up speaking Hidatsa, as it was the language of his father\'s people with whom he lived. However, he also learned French from his mother and English later in life.'),(3396,'What Future Publishing founder co-hosted the annual TED Conference with June Cohen?','The Future Publishing founder who co-hosted the annual TED Conference with June Cohen is Richard Saul Wurman.'),(3397,'What is the worth of the logo that appears alongside the \'Just Do It\' slogan?','The logo that 