here anything else I can help you with?'),(4386,'Which constituent college of the University of Oxford in England was Francis Leighton warden of?','Francis Leighton was the warden of All Souls College, Oxford from 1855 until his death in 1878.'),(4387,'Calling All Dawns includes the theme for the game \'Civilization IV,\' written by whom?','Calling All Dawns includes the theme for the game \'Civilization IV,\' which was written by Christopher Tin. It\'s called \'Baba Yetu\' and it won a Grammy award for Best Instrumental Arrangement Accompanying Vocalists in 2011.'),(4388,'What occupations are shared by Maher Sabry and Til Schweiger?','Maher Sabry and Til Schweiger are both actors and filmmakers. Maher Sabry is an Egyptian filmmaker and actor, known for his work in LGBT cinema, while Til Schweiger is a German actor, director, and producer who has appeared in several Hollywood films.'),(4389,'What service is an Amtrak flagship that includes BWI Rail Station as one of its Amtrak intercity services?','The Amtrak flagship that includes BWI Rail Station as one of its Amtrak intercity services is the Acela Express. The Acela Express is a high-speed train service that operates in the Northeast Corridor between Boston and Washington D.C., stopping at several major cities along the way, including Baltimore.'),(4390,'Did Ed Sullivan ever work anywhere other than the New York Daily News?','Yes, Ed Sullivan worked as a sports reporter for various newspapers before joining the New York Daily News in 1927. He also wrote a syndicated column for the Chicago Tribune in the 1940s and 1950s, and later hosted his own television variety show, \'The Ed Sullivan Show.\''),(4391,'What is  Cyaxares relationship to the man that governed for 53 years?','Cyaxares was the son of Phraortes, who was the man that ruled for 53 years. Cyaxares succeeded Phraortes after his death and became the third king of the Median Empire. Therefore, they had a father-son relationship.'),(4392,'Which late 1980s and 1990s English super model was featured in the song nasty girl by The Notorious B.I.G.?','The late 1980s and 1990s English supermodel who was featured in the song \'Nasty Girl\' by The Notorious B.I.G. is named Janice Dickinson.'),(4393,'Why did Rudolf Hess stop serving Hitler in 1941?','Rudolf Hess, who was a high-ranking Nazi official and an early confidante of Adolf Hitler, flew to Scotland in May 1941, reportedly to negotiate a peace settlement with Britain. The exact reason for his departure remains unclear, but some historians speculate that Hess was growing increasingly disillusioned with the direction of the war and Hitler\'s leadership. Others suggest that he was motivated by personal ambition or a desire to position himself as Hitler\'s successor. Whatever the case may be, his actions were not authorized by Hitler, and he was immediately arrested upon his arrival in Scotland. He spent the rest of the war as a prisoner of the Allies.'),(4394,'what other school is located in the same suburb as the Ghana Police College?','The Ghana Police College is located in the town of Tesano in the Accra Metropolis district of Ghana. One school located in the same suburb as the Ghana Police College is the Ghana Christian International High School.'),(4395,'Who did the 39th Vice President of the United States serve under?','The 39th Vice President of the United States, who served from 2005-2009, was Richard \'Dick\' Cheney. He served under President George W. Bush.'),(4396,'This Fox News Specialist Host also took over what Fox Business Channel news program in 2013?','The Fox News Specialist host who also took over the Fox Business Channel news program in 2013 is Eric Bolling.'),(4397,'What type of media does Jeff Rona and Veeram have in common?','Jeff Rona and Veeram have music media in common. Jeff Rona is a music composer, and Veeram is an Indian Tamil-language action film for which Jeff Rona composed the soundtrack.'),(4398,'What was the official religion of the lands of the husband of Dorothea of Denmark, Duchess of Prussia?','Dorothea of Denmark\'s husband was Duke Albert of Prussia, and during their time, the official religion of the lands was Lutheranism. In fact, Duke Albert played a key role in promoting the Reformation and establishing Lutheranism as the state religion of Prussia.'),(4399,'What year did the movement that Tess Asplund protested in the viral image of her with her fist in the air disband?','Tess Asplund was protesting against the Nordic Resistance Movement (NRM) in May 2016. However, the NRM still exists as a far-right, neo-Nazi organization in some Nordic countries, but it has faced legal restrictions and bans in some places.'),(4400,'What episode did Mona Penelope Simpson  on the animated show \'The Simpsons\'die?','Mona Penelope Simpson, the mother of Homer Simpson, died in the episode \'Mona Leaves-a,\' which is the 19th episode of the 19th season of The Simpsons. It originally aired on May 11, 2008.'),(4401,'Who starred in My Dog Skip and Malcolm in the Middle?','The actor who starred in both \'My Dog Skip\' and \'Malcolm in the Middle\' is Frankie Muniz.'),(4402,'What man, born in 1963, was instrumental in bringing the Boston Red Sox to the stadium City of Palms Park in Fort Myers, Florida?','That man is Larry Lucchino, a former CEO and President of the Boston Red Sox.'),(4403,'Which singer has been in more music bands, Michael Crafter or Martin Degville?','Michael Crafter has been in more music bands than Martin Degville. Crafter has been a member of numerous bands, including I Killed The Prom Queen, Carpathian, Confession, and Ghost Inside, while Degville is mainly known for his work with the bands Sigue Sigue Sputnik and Sputnik2.'),(4404,'Which was secretary to President Richard Nixon: Rose Mary Woods or H. R. Haldeman?','H. R. Haldeman was the secretary to President Richard Nixon. Rose Mary Woods was his personal secretary.'),(4405,' Are Finding Kraftland and Shikashika both frozen drinks?','No, F