hip.'),(4574,'What Cuban American baseball player was suspended in the new steroid policy of the 2005 Major League Baseball season?','Cuban American baseball player Rafael Palmeiro was suspended in the new steroid policy of the 2005 Major League Baseball season. He tested positive for an anabolic steroid called stanozolol.'),(4575,'The German software corporation who has established Remote Function Call (RFC) has its headquarters in what city?','The German software corporation that has established Remote Function Call (RFC) has its headquarters in Walldorf, Germany.'),(4576,'What documentary has more creators, The Devil Came on Horseback or My Best Fiend?','My Best Fiend is a documentary that has more creators. The film was directed and produced by Werner Herzog, and it focuses on his tumultuous relationship with actor Klaus Kinski. In addition to Herzog\'s work, My Best Fiend features contributions from cinematographers, editors, and sound designers. \n\nIn contrast, The Devil Came on Horseback was primarily directed and produced by Annie Sundberg and Ricki Stern, with additional editing and sound work from a small team of collaborators.'),(4577,'In which year did this Russian actress  who produced and performed in the 1922 American silent drama film \'A Doll\'s House\' immigrate to the United States?','The Russian actress you are referring to is Alla Nazimova. She immigrated to the United States in 1905, almost 17 years before the production of \'A Doll\'s House\'.'),(4578,'Is The Moon-Spinners and Oceans both documentaries?','No, \'The Moon-Spinners\' is a 1964 Disney film based on a novel by Mary Stewart, while \'Ocean\' is a 2009 nature documentary directed by French filmmaker Jacques Perrin.'),(4579,'The CNN-News18 Indian of the Year award was created by Sagarika Ghose and a news anchor born in what year?','Sagarika Ghose was born on November 8, 1964.'),(4580,'Which district includes the island in New York City\'s East River which Pete Grannis represented in t