nsus Bureau.'),(5329,'Back Home is a children\'s historical novel adapted into a TV drama starring what English actress born in 1946?','The  TV drama adaptation of the children\'s historical novel \'Back Home\' stars Hayley Mills. She was born on April 18, 1946, in London, England.'),(5330,'Katrina Ross starred in \'The Singing Nun\' with who as the title role?','Debbie Reynolds played the role of the nun, Sister Ann in the 1966 film \'The Singing Nun,\' with Katrina Ross portraying the character Genevieve.'),(5331,'Are both Days of the New and TV on the Radio from New York?','TV on the Radio is a band that formed in Brooklyn, New York in 2001. Days of the New is not from New York; they are a band from Louisville, Kentucky that formed in 1995.'),(5332,'Are Todd Haynes and Chris Columbus of the same nationality?','No, Todd Haynes and Chris Columbus are not of the same nationality. Todd Haynes was born in Los Angeles, California, United States, and is American, while Chris Columbus was born in Spangler, Pennsylvania, United States, and is also American.'),(5333,'When was Leeds no longer called Elmet?','Leeds was predominantly referred to as Elmet in the Anglo-Saxon period, however, there is no clear date when it stopped being called Elmet. Over time, the name Leeds became more commonly used and eventually replaced the use of Elmet as the area grew in population and importance. By the time of the Norman Conquest in 1066, the name Leeds had begun to emerge as the primary name for the area.'),(5334,'Ip Man 3 is the second sequal to the biographical martial arts films first released in what year?','\'Ip Man 3\' is actually the third installment in the \'Ip Man\' film series. The first film was released in 2008.'),(5335,'What American agronomist that worked on The Green Revolution won a Nobel Peace Prize?','Norman Borlaug, an American agronomist, won the Nobel Peace Prize in 1970 for his work on The Green Revolution. He is credited with saving millions of lives through his development of high-yielding wheat varieties and other agricultural innovations.'),(5336,'Which Five Finger Death Punch discography albulm was released on September 22, 2009 through Prospect Park?','The Five Finger Death Punch album that was released on September 22, 2009 through Prospect Park is called \'War Is the Answer\'.'),(5337,'How do the Peter Laufer books Forbidden Creatures and No Animals Were Harmed differ in their focus on animals?','In Forbidden Creatures, Peter Laufer focuses on the taboo and often illegal trade in exotic and endangered animals around the world. He details the cruelties that animals face in this trade and the insatiable greed of those who traffic them. By contrast, in No Animals Were Harmed, Laufer explores the use and abuse of animals in the entertainment industry, including in films, television shows, and circuses. He examines the ethical and legal issues surrounding the treatment of animals in these industries and calls for greater protections for them. So while both books deal with issues related to animals, their focus is different: Forbidden Creatures is about illegal trafficking, while No Animals Were Harmed is about the use of animals in entertainment.'),(5338,'What 1958 born American television writer and actress contributed to the writing on I Am Not Homer?','The 1958 born American television writer and actress who contributed to the writing on \'I Am Not Homer\' is Mindy Kaling.'),(5339,'Were Ransom Riggs and John Berry from the same country?','Yes, Ransom Riggs and John Berry are both from the United States of America.'),(5340,'The winning jockey of the 1997 Cheltenham Gold Cup held a record for winner of what award 20 consecutive times?','The winning jockey of the 1997 Cheltenham Gold Cup, Mr. Adrian Maguire, held the record for the winner of the Conditional Jockeys\' Championship Award for 20 consecutive years.'),(5341,'Which publisher released the prequel to the 2012 novel Boneland in 1960?','Boneland is the final book 