ished in October 1956. Heat, on the other hand, is a novel by Mike Lupica and was originally published in 2006.'),(5354,'Who designed the building that the 58th Technology & Engineering Emmy Awards were held in?','I\'m sorry, I don\'t have that information. Can you please provide more context about the specific building you\'re referring to?'),(5355,'What did Eric Radomski produce that premiered on Disney XD on May 26, 2013?','Eric Radomski did not produce anything that premiered on Disney XD on May 26, 2013. However, he was the producer and executive producer of several animated TV shows and movies, including Batman: The Animated Series, Spawn: The Animated Series, and Batman: Mask of the Phantasm.'),(5356,'Are Portland International Airport and Gerald R. Ford International Airport both located in Oregon?','No, they are not both located in Oregon. Portland International Airport is located in Portland, Oregon, while Gerald R. Ford International Airport is located in Grand Rapids, Michigan.'),(5357,'The composer for the music in the film \'A Clockwork Orange\' was born in which state?','The composer for the music in the film \'A Clockwork Orange\' was Wendy Carlos. Wendy Carlos was born in Rhode Island, USA.'),(5358,'The film Navakoti Narayana was based on the life of Purandara Dasa who was born in what year?','Purandara Dasa, who was a great saint and composer of Carnatic music, was born in the year 1484.'),(5359,'How many times has the author of Writing with Intent been shortlisted for the Booker Prize ? ','The author of \'Writing with Intent,\' Margaret Atwood, has been shortlisted for the Booker Prize five times: for \'The Handmaid\'s Tale\' (1986), \'Cat\'s Eye\' (1989), \'Alias Grace\' (1996), \'The Blind Assassin\' (2000), and \'The Testaments\' (2019).'),(5360,'In which county is the university, at which Roger Groot was the Class of 1975 Alumni Professor of Law, located?','I\'m sorry, I don\'t have enough information to give you a specific answer. Could you please provide me with the name of the university or any additional details?'),(5361,'When did Peter Capaldi play the role of Mr. Curry in Paddington 2?','Peter Capaldi played the role of Mr. Curry in the 2017 film \'Paddington 2\'.'),(5362,'What waltz was composed by \'The Waltz King\' in 1844?','The Waltz King Johann Strauss II composed \'The Beautiful Blue Danube\' in 1844, one of the most famous and beloved waltzes in the world.'),(5363,'New Jersey politicians Linda Stender and Leonard Lance were born within a year of each other beginning in which year?','Linda Stender was born on June 7, 1952, and Leonard Lance was born on June 25, 1952. So they were both born in the year 1952.'),(5364,'Aerodynamik is a Kraftwerk song on an album recorded for what anniversity of the Tour de France bicycle race?','\'Aerodynamik\' is a song by the German electronic music band Kraftwerk. It was released on their album \'Tour de France Soundtracks\' in 2003. The album was recorded to commemorate the 100th anniversary of the Tour de France bicycle race.'),(5365,'Who was born first, Lecrae Devaughn Moore or Gawvi?','Lecrae Devaughn Moore was born first, on October 9, 1979, and Gawvi was born on September 23, 1988.'),(5366,'What do Woodstock and American Dream have in common?','Woodstock and the American Dream both have significant cultural and historical importance in American society. Woodstock was a music festival held in 1969 which represented a counterculture movement challenging traditional values of the time. The American Dream represents the optimistic belief in social mobility and economic prosperity achieved through hard work and dedication. Both Woodstock and the American Dream symbolize the pursuit of personal and social freedoms and a desire to challenge the existing status quo.'),(5367,'The former Associate Director of the Northeast Intelligence Network has wrote for a publication which typically falls where on the political spectrum?','I\'m sorry, but I cannot provide an answer to that question as I don\'t have enough information about the publication in question. Can you please provide more details or context?'),(5368,'Are the movies \'Monsters, Inc.\' and \'Mary Poppins\' both by the same company?','No, they are not. Monsters, Inc. is a 2001 computer-animated film produced by Pixar Animation Studios and released by Walt Disney Pictures. Mary Poppins is a 1964 musical fantasy film directed by Robert Stevenson and produced by Walt Disney Productions.'),(5369,'What actor replaced the Welch actor born in 1978 who played Robin Hood in the first season of \'Once upon a Time\'?','The Welsh actor born in 1978 who played Robin Hood in the first season of Once Upon a Time was Tom Ellis. The role was later recast, and Sean Maguire replaced him in the subsequent seasons.'),(5370,'I Love Melvin is a musical and dancing comedy film starring an American dancer, singer, and actor who co=starred with a talking mule named what? ','The American dancer, singer, and actor who co-starred with a talking mule in a series of films was named Donald O\'Connor. However, \'I Love Melvin\' had no mule and starred O\'Connor alongside Debbie Reynolds.'),(5371,'June Martino served as bookkeeper for the man who revolutionized what company?','June Martino served as a bookkeeper for Ray Kroc, who revolutionized the fast-food industry by turning McDonald\'s into a global franchise.'),(5372,'From which phrase the name of the place where Hazina Towers is under construction?','Unfortunately, I do not have enough contextual information to answer your question accurately. Can you please provide more context or details about the place you are referring to?'),(5373,'The American Astronomical Society presents an award named after what New Zealand astronomer?','The American Astronomical Society (AAS) presents the Beatrice M. Tinsley Prize to recognize and honor outstanding research in astronomy or astrophysics by a scientist belonging to the society. The prize is named after