s winning World Cup team in the year 1966.'),(5404,'What is the genus and species of the bear in which the Florida black bear is a subspecies of?','The Florida black bear (Ursus americanus floridanus) is a subspecies of the American black bear (Ursus americanus).'),(5405,'Australian Associated Press was established by a journalist born in which year ?','Australian Associated Press (AAP) was established by Keith Murdoch, a journalist born in the year 1885.'),(5406,'Who was the electoral division that James Tully  represented in 1928 named after?','James Tully represented the electoral division of Lincoln in New Zealand in 1928. The name \'Lincoln\' is believed to have been chosen because the town was named after the American President, Abraham Lincoln, by early settlers in the area.'),(5407,'The transnational lottery Les Scadding won in 2009 held it\'s first draw on what date?','The transnational lottery Les Scadding won in 2009 is the EuroMillions, and it held its very first draw on February 13, 2004.'),(5408,'In what English district is the town Digby, Victoria may be named after?','Digby, Victoria in Australia was likely named after the English district of Digby in Lincolnshire, England, which was the birthplace of Sir Henry Brougham Loch, an important figure in early Australian history.'),(5409,'Deckers Creek begins west of an unincorporated area in what West Virginia county?','Deckers Creek begins west of an unincorporated area in Monongalia County, West Virginia.'),(5410,'Who coached the Indians and was the first Native American to win a gold metal his home country?','Jim Thorpe was the first Native American to win a gold medal in his home country. He was a well-known athlete who competed in the 1912 Olympics in Stockholm and won gold medals in the Decathlon and Pentathlon. However, he did not coach the Indians baseball team. It is unclear from your question which Indians team you are referring to, but the most famous Indians baseball team is the Cleveland Indians.'),(5411,'The M104 155mm Projectile was specifically designed to carry about 11.7 pounds of what prototypical substance?','The M104 155mm Projectile was specifically designed to carry about 11.7 pounds of the prototype substance called VX nerve agent, which is a highly poisonous chemical warfare agent.'),(5412,'What is the nickname of the regional dialect from the city from which the English Footballer Tomi Ameobi was born in?','Tomi Ameobi was born in Newcastle upon Tyne, England, and the regional dialect from there is commonly referred to as Geordie.'),(5413,'Which nationality is the international footballer, born 20 March 1984, who made his breakthrough La Liga debut in the 2002–03 Atlético Madrid season, scoring 13 league goals as a teenager?','The international footballer you are referring to is Fernando Torres. He is a retired Spanish footballer who played for Atlético Madrid, Liverpool, Chelsea, AC Milan, Sagan Tosu, and the Spanish national team.'),(5414,'How many members exist in the conference represented by the Michigan State Spartans in the 1993 Liberty Bowl?','The Michigan State Spartans represented the Big Ten Conference in the 1993 Liberty Bowl. At that time, the Big Ten Conference consisted of 10 member institutions.'),(5415,'The \'unofficial national anthem\' of Australia is the basis for the nickname of what soccer team?','The nickname of the Australian soccer team is \'Socceroos,\' which is derived from the unofficial national anthem of Australia, \'Waltzing Matilda.\''),(5416,'What are the two categories of the non-electric version of the neighbourhood electric vehicle?','The two categories of the non-electric version of the neighborhood electric vehicle are gas-powered and hybrid electric. Gas-powered vehicles use a traditional internal combustion engine to power the vehicle, while hybrid electric vehicles combine an internal combustion engine with an electric motor to improve fuel efficiency and reduce emissions.'),(5417,'What was the slogan  that came about from the idea of Lebensraum which had its most extreme form supported by the Nazi Party until the end of World War II?','The slogan that came about from the idea of Lebensraum and was supported by the Nazi Party was \'Lebensraum im Osten\' or \'Living Space in the East.\' It referred to the territorial expansion of Germany into Eastern Europe and the Soviet Union, which the Nazis believed was necessary to provide room and resources for the German people.'),(5418,'Are Chumbawamba and Spin Doctors from the same country?','No, Chumbawamba and Spin Doctors are not from the same country. Chumbawamba is a British band, while Spin Doctors is an American band.'),(5419,'What is the birthplace of the musician responsible for creating The Motion Makes Me Last?','The musician responsible for creating \'The Motion Makes Me Last\' is Feist, and she was born in Amherst, Nova Scotia, Canada.'),(5420,'Where was David Angell headed when he died aboard the American Airlines Flight 11?','David Angell was headed to Los Angeles on American Airlines Flight 11 on September 11, 2001. He was returning home from a vacation with his wife, Lynn. Unfortunately, he was among the 87 passengers who died when the plane was hijacked and flown into the World Trade Center in New York City.'),(5421,'What position does Kyle York hold at the internet performance management company Dyn?','Kyle York is the Vice President of Product Strategy and Worldwide Sales at Dyn, an internet performance management company.'),(5422,'Which member of the boy group Shinee released their first studio album \'She is\'?','The member of the boy group SHINee that released their first studio album \'She Is\' is Jonghyun.'),(5423,'Which conflict was this person whose assassination led to Mark Fulton taking over command the Loyalist Volunteer Force involved in?','The individual whose assassination led to Mark \'Swinger\' Fulton taking over command of the Loyalist Volunteer Force (LVF) was Billy Wright. Wright, also known as \'King Rat\', was the founder and original leader of the LVF. He was assassinated on December 27, 1997, inside HM Prison Maze by members of the Irish National Liberation Army (INLA). The conflict that the LVF and other loyalist paramilitary groups were involved in was the Troubles in Northern Ireland. The Troubles were an ethno-nationalist conflict that lasted from the late 1960s to 1998, and pitted primarily Catholic nationalists, who wanted a united Ireland, against Protestant unionists, who wanted Northern Ireland to remain part of the United Kingdom.'),(5424,'Before the 2004-2005 Minnesota Timberwovles season, what had Sam Cassell had been honored with what titles?','Before the 2004-2005 NBA season, Sam Cassell had won two NBA championships with the Houston Rockets in 1994 and 1995, and was also an NBA All-Star in 2004.'),(5425,'What conference does Ralphie the Buffalo\'s football team play in?','Ralphie the Buffalo is the live mascot of the University of Colorado\'s football team. The team plays in the Pac-12 Conference.'),(5426,'What 2-year worldwide tour had a round stage and a band that performed a song never before performed live?','The tour you\'re referring to is likely the U2 360° Tour, which ran from 2009 to 2011. The tour featured a unique round stage that allowed for a 360-degree view for the audience. During the tour, U2 performed a song called \'North Star\' for the first time ever live.'),(5427,'My Sentimental Friend was performed by which English beat rock band?','\'My Sentimental Friend\' was a song performed by the English rock band, Herman\'s Hermits. It was written by Graham Gouldman and Charles Silverman and released as a single in 1969.'),(5428,'How many episodes were in the 23rd season of a Fox network show which, in it\'s twenty-second season, aired it\'s twenty-first episode which was written by John Frink and directed by Bob Anderson.','The show you\'re referring to is \'The Simpsons.\' The 23rd season of the show had 22 episodes in total.'),(5429,'The 2000–01 A.S. Roma season had several important signings, one of which was a player that Javier Zanetti referred to him as being what kind of player?','The player that Javier Zanetti referred to in the 2000-01 A.S. Roma season was Francesco Totti, and he referred to him as \'the kind of player who can make things happen out of nothing\'.'),(5430,'What is the middle name of the actress who played Lucy Baker in the TV series Lassie ?','The actress who played Lucy Baker in the TV series Lassie is Jan Clayton, but I couldn\'t find any information about her middle name.'),(5431,'What university employed the psychologist that inspired David McClelland\'s thinking on power??','The psychologist who inspired David McClelland\'s thinking on power was John W. Atkinson, who was a professor of psychology at the University of Michigan, during McClelland\'s graduate studies there in the 1940s.'),(5432,'Which player selected out of the University of Florida with the third pick by the Hawks was born in June 3, 1986?','The player selected out of the University of Florida with the third pick by the Hawks who was born on June 3, 1986 is Al Horford.'),(5433,'What are both Eleutherococcus and Amaryllis?','Eleutherococcus is a genus of shrubs in the Araliaceae family that is native to northeastern Asia. It is also known as Siberian ginseng or eleuthero and is used medicinally for its adaptogenic properties.\n\nAmaryllis is a genus of flowering bulbs that are native to South America and Africa. They are popular ornamental plants and are commonly grown in gardens or as indoor plants. Some species, like the Belladonna Lily, are also used for medicinal purposes.'),(5434,'What is the familiar name for the first operation in the Battle of Normandy, also codenamed Operation Overlord?','The familiar name for the first operation in the Battle of Normandy, codenamed Operation Overlord, is D-Day.'),(5435,'Who died first, Chester Erskine or Sam Taylor?','Sam Taylor died first. He passed away on March 6, 1958, while Chester Erskine died on February 23, 1966.'),(5436,'After whom was the area, where  The Phillips Collection is located, named ?','The Phillips Collection is located in the Dupont Circle neighborhood in Washington D.C. The area, Dupont Circle, is named after Samuel Francis Du Pont, a Rear Admiral in the United States Navy, who served during the Civil War.'),(5437,'Where was the set for the winner of the WD Weatherford Award in 1998?  ','The WD Weatherford Award is given annually to a writer who has published a debut novel. In 1998, the winner of the award was Samantha Gillison for her novel \'The King of America\'. However, I do not have information about where the award ceremony or set was held. It is possible that it was not held on a specific set, but rather in a banquet hall or ballroom.'),(5438,'Which magazine has more issues per month, Club or Pro Football Weekly ','Pro Football Weekly has more issues per month than Club. \n\nPro Football Weekly is a weekly magazine, meaning it releases 4 issues per month. \n\nClub magazine, on the other hand, is a monthly magazine, meaning it releases 1 issue per month.'),(5439,'\'A Swingin\' Safari\' was a song written originally by German songwriter Bert Kaempfert but made popular by who?','\'A Swingin\' Safari\' was made popular by American bandleader Billy Vaughn in 1962.'),(5440,'Which acter/director is known for depicting the Russian working class life and directed a film that won an Academy Award in 1981?','The actor/director you are referring to is probably Ivan Passer, who directed the film \'Cutter\'s Way\' in 1981. This film won an Academy Award for Best Supporting Actor for actor John Heard. Although Passer was not born in Russia, he was a Czech filmmaker who often explored themes of working-class life and social injustice in his films.'),(5441,'Peter and the Wolf was originally released as a segment of an animated anthology released to theaters on which day ?','The original animated anthology \'Make Mine Music,\' which included the \'Peter and the Wolf\' segment, was released to theaters on April 20, 1946 in the United States.'),(5442,'Were Maurice Tourneur and Greg Mottola both American film directors?','Yes, both Maurice Tourneur and Greg Mottola are American film directors. However, they come from different eras of American film history. Maurice Tourneur directed movies during the silent film era from the 1910s to the 1920s, while Greg Mottola directed movies in the contemporary era from the 1990s to the present day.'),(5443,'Who is younger, Dan Bejar and Makoto Koshinaka?','I\'m sorry, I don\'t have access to the birth dates of Dan Bejar and Makoto Koshinaka. Can I help you with anything else?'),(5444,'Zamalek Sporting Club Centennial was a  friendly match against professional football club that plays in what?','The Zamalek Sporting Club Centennial was a friendly match played between Zamalek SC and Paris Saint-Germain FC in January 2011. Paris Saint-Germain FC is a professional football club that plays in Ligue 1, the top tier of football in France.'),(5445,'The eastern coast of Ivan Zammit\'s birth city is located along what body of water? ','I\'m sorry, but I do not have information on the birth city of Ivan Zammit. Can you please provide me with the name of his birth city or any additional information that can help me answer your question?'),(5446,'Which son of Rick Barry was born first, Brent Robert Barry or Drew William Barry?','Brent Robert Barry was born first, on December 31, 1971, while Drew William Barry was born on February 17, 1973.'),(5447,'Have Marc Rosset and Max Mirnyi both been professional tennis players?','Yes, both Marc Rosset and Max Mirnyi have been professional tennis players. Marc Rosset was a Swiss player who turned pro in 1988 and won a gold medal at the 1992 Olympics in Barcelona. Max Mirnyi is a former professional tennis player from Belarus who turned pro in 1996 and won several Grand Slam doubles titles throughout his career.'),(5448,'What year was the inventor of Rejuvelac born?','The inventor of Rejuvelac, Dr. Ann Wigmore, was born on March 4, 1909.'),(5449,'Which amusement park at Coney Island, Brooklyn, New York City,  without being the grandest, was the island\'s longest lasting?','The Steeplechase Park was the longest lasting amusement park in Coney Island. It opened in 1897 and operated for over 70 years, until it closed in 1964.'),(5450,'What is another movie the director of Marvel Cinematic Universe\'s fifteenth film is known for?','The director of Marvel Cinematic Universe\'s fifteenth film is James Gunn. He is also known for directing the movies \'Slither\' and \'Super\'.'),(5451,'The brother of Ferdinand Alfred Friedrich Jodl served as what position in World War II?','Ferdinand Alfred Friedrich Jodl was a German military commander and General during World War II. His brother, Josef Jodl, also served in the military and held the rank of Major in the Army. He was involved in military operations in various regions, including France, North Africa, and the Soviet Union. In early 1943, Josef Jodl was appointed as the Chief of Staff for the German Army in Italy. He held this position until the end of the war.'),(5452,'Which film stars more animals, The Jungle Book or The Lone Ranger?','The film that features more animals is undoubtedly The Jungle Book, which is a Disney live-action remake of its 1967 animated film. The movie has various animals who talk, dance and even sing in most of the film\'s scenes. In contrast, The Lone Ranger has a few animals, including horses but they do not play significant roles in the narrative.'),(5453,'Where did the host of the 2014 edition of the MTV Africa Music Awards begin their career?','The host of the 2014 edition of the MTV Africa Music Awards was Marlon Wayans. However, he is not an African and did not begin his career in Africa. Marlon Wayans is an American actor, comedian, writer, and producer, who began his career in Hollywood in the 1980s.'),(5454,'Nevada\'s second busiest commercial airport was named after which career United States Army officer?','The second busiest commercial airport in Nevada is named after Pat McCarran who was a career United States Army Officer and a US Senator from Nevada. The airport is known as the McCarran International Airport.'),(5455,'Taylor Momsen and Craig Mabbitt from Escape the Fate have what in common?','Taylor Momsen and Craig Mabbitt both have been associated with the music genre of rock/metal. Taylor Momsen was the lead singer of the rock band The Pretty Reckless, and Craig Mabbitt is the current vocalist for the metalcore band Escape the Fate.'),(5456,'Widewuto, a legendary king of the pagan Prussians, was believed to have existed before which army launched crusade against the Prussian peoples?','Widewuto, also known as Widukind or Wittekind, was a legendary king of the pagan Prussians who lived in the 6th century AD. The Prussian Crusade was launched by the Teutonic Knights in the late 12th century, so Widewuto is believed to have existed long before the crusade.'),(5457,'What former Los Angeles Lakers majority owner is the father of Jeanie Marie Buss?','The former Los Angeles Lakers majority owner who is the father of Jeanie Marie Buss is Jerry Buss.'),(5458,'Which genus\'s family comes first alphabetically, Crepis or Isatis?','Crepis comes first alphabetically.'),(5459,'What year was the recipient of the 2016 Best Footballer in Asia born?','The recipient of the 2016 Best Footballer in Asia was Omar Abdulrahman from the United Arab Emirates, and he was born on September 20, 1991.'),(5460,'August R. Lindt served as chairman of a UN program from 1956 to 1960 that won how many noble prizes ?','August R. Lindt did not serve as chairman of any UN program that won a Nobel Prize. However, the UN itself was awarded the Nobel Peace Prize in 2001 for its work towards promoting international cooperation and resolving conflicts peacefully.'),(5461,'What MLB pitcher nicknamed \'Gander\' was written about in \'the Stratton Story\'>?','The MLB pitcher nicknamed \'Gander\' who was written about in \'The Stratton Story\' is Monty Stratton.'),(5462,'What was the company that was co-owned by the person who Abbe error was named after?','The Abbe error is a term used in optics, and it is named after Ernst Abbe, who co-owned the company Carl Zeiss.'),(5463,'What railroad in which Challengers were most common was completed in 1915?','The railroad where Challengers were most common that was completed in 1915 is the Western Pacific Railroad.'),(5464,'What stadium does the team who has Kent Baer as the defensive coordinator play its home games?','I\'m sorry, but I don\'t have enough information to answer your question. Can you please provide the name of the team?'),(5465,'Were both Alvin Lee and Chad Gray lead vocalists for bands?','Yes, Alvin Lee was the lead vocalist and guitarist for the band Ten Years After, known for their hit song \'I\'d Love to Change the World\'. Chad Gray is also a lead vocalist, known for his work with the bands Mudvayne and Hellyeah.'),(5466,'Which U.S. State contains tropical wetlands and Diamondback Airboats?','The U.S. State that contains tropical wetlands and Diamondback Airboats is Florida. The famous wetland areas in Florida are the Everglades, which are home to a diverse range of flora and fauna. The Diamondback Airboats are often used to explore these wetlands and offer a unique and adventurous way to experience the natural beauty of the area.'),(5467,'Who was the narrator of the 26-episode series which featured the British national museum organization with branches at five locations in England?','The 26-episode series you are referring to is called \'Civilisations\' and it had three different presenters, one of which would narrate each episode. The presenters were Simon Schama, Mary Beard, and David Olusoga.'),(5468,'What is the birth date of the person Richard Callaghan coached to