d \'Russia\'s Obama\' is considered to belong to what ethnic group based on his having African heritage or dark skin?','Jean Sagbo, who served as the Deputy Head of the Moscow Department of Culture, was born in Benin, Africa, and has African heritage. Therefore, he is most likely considered to belong to the African ethnic group, rather than a specific ethnic group based solely on his dark skin.'),(5475,'O\'Halloran Hill in South Australia has a suburb of what town, with a population of over 12000 people?','O\'Halloran Hill is a suburb of the City of Marion in South Australia, which has a population of over 12,000 people according to the 2016 Australian Census.'),(5476,'Who has lived longer in the USA, Ulli Lommel or Benjamin Stoloff?','Benjamin Stoloff lived longer in the USA. He was born on October 6, 1895, and passed away on September 8, 1960, at the age of 64. Ulli Lommel was born December 21, 1944, and passed away on December 2, 2017, at the age of 72.'),(5477,'Fash Mosque is 4.5 km away from which mosque originally built by Muhammad?','The mosque originally built by Prophet Muhammad (PBUH) is Masjid Quba. It is located in Medina, Saudi Arabia. Fash Mosque is not located in Medina, so it is not 4.5 km away from Masjid Quba.'),(5478,'When was the federal US law made that was responsible for shutting down Braniff Airways?','The federal US law that led to the bankruptcy of Braniff Airways was the Airline Deregulation Act of 1978. This law removed government control over fares, routes and market entry of new airlines, which led to increased competition and ultimately the downfall of Braniff Airways.'),(5479,'What was the name of the person that was interviewed and later written about by John G. Neihardt?','The person that was interviewed and later written about by John G. Neihardt was Black Elk, a Lakota medicine man and holy man. The book is called \'Black Elk Speaks.\''),(5480,'Shaqtin\' a Fool has included which television personality who worked for 8 yearst at ESPN?','Shaqtin\' a Fool, which is a segment on the NBA on TNT show, featured former ESPN personality Jemele Hill, who worked at the network for 12 years before leaving in 2018.'),(5481,'Which was published first Polarity or The Farming Game?','The Farming Game was published first in 1979, while Polarity was published in 2003.'),(5482,'Which team was a Dutch former professional footballer sacked from in 2009 after the team underperformed in a string of games for the qualification for the Champions League? ','The Dutch former professional footballer who was sacked from a team in 2009 after underperforming in a string of games for the qualification for the Champions League is Marco van Basten. Van Basten was sacked by AFC Ajax in May 2009 due to poor results in the Dutch Eredivisie and not qualifying for the Champions League.'),(5483,'The Julian P. Kanter Political Commercial Archive has been designated an official project by an initiative to preserve and protect what?','The Julian P. Kanter Political Commercial Archive has been designated an official project by an initiative to preserve and protect America\'s television commercial history.'),(5484,'Neil B. Shulman was the associate producer of what 1991 American romantic comedy film directed by Michael Caton-Jones?','The film is \'Doc Hollywood\'.'),(5485,'Which company has more divisions within it, WPX Energy or Hewlett Packard Enterprise?','Hewlett Packard Enterprise has more divisions within it than WPX Energy. While WPX Energy is primarily focused on oil and gas exploration, Hewlett Packard Enterprise has divisions in various industries including cloud computing, software and services, servers, storage, and networking. Additionally, Hewlett Packard Enterprise has several subsidiary companies that also have multiple divisions.'),(5486,'which is larger, Hunchun or Shijiazhuang?','Shijiazhuang is larger than Hunchun. Shijiazhuang is the capital and largest city of Hebei Province in North China, with a population of over 10 million people. Hunchun, on the other hand, is a city in the northeast of China, located in Jilin Province, with a population of around 238,000 people.'),(5487,'What is the name of the umcoming horror film adaptation starring Melanie Griffiths daughter?','The upcoming horror film adaptation starring Melanie Griffith\'s daughter is called \'The Nowhere Inn\'.'),(5488,'Where was the music festival Billy McFarland was charged with wire fraud for supposed to take place?','The music festival Billy McFarland was charged with wire fraud for was supposed to take place in Great Exuma, in the Bahamas, and was named the Fyre Festival.'),(5489,'Which artist was Italian, Sergio Leone or Jon Paul Puno?','Sergio Leone was Italian. Jon Paul Puno is not an artist, but a name that doesn\'t appear to be associated with any notable artist.'),(5490,'What type of art does The Consul and Arlecchino have in common?','The Consul and Arlecchino are two different operas with different composers and styles of music, but they both belong to the genre of opera. Opera is a form of musical theater in which a dramatic work is set to music and sung by performers, with the addition of costumes, sets and lighting. Therefore, the type of art that The Consul and Arlecchino have in common is opera.'),(5491,'The player who defeated Johnny Majors for the Heisman Trophy in 1956 was born in what year?','Paul Hornung, who defeated Johnny Majors for the Heisman Trophy in 1956, was born on December 23, 1935.'),(5492,'Which actor that has performed as Inspector Javert in a Les Misérables production Has won the Laurence Olivier Award for Best Actor in a musical three times?','The actor who has played Inspector Javert in a Les Misérables production and has won the Laurence Olivier Award for Best Actor in a musical three times is Michael Ball.'),(5493,'What year did Lindsey Broad star in the movie with Russell Brand and Jonah Hill?','Lindsey Broad starred in the movie \'Get Him to the Greek\' with Russell Brand and Jonah Hill in 2010.'),(5494,'Archie Norman will succeed Robert Swannell as chairman of what British multinational retailer that is headquartered in the city of Westminster, London?','Archie Norman will succeed Robert Swannell as chairman of Marks & Spencer, a British multinational retailer that is headquartered in the city of Westminster, London.'),(5495,'Where is the company, which designed the Glomar Challenger, based?','The Glomar Challenger was designed by the Global Marine company. At the time when the Glomar Challenger was built in the 1960s, Global Marine was based in Los Angeles, California, USA. However, the company is currently based in Houston, Texas.'),(5496,'Charles Hurt is currently the opinion editor of \'The Washington Times\', Fox News contributor, Breitbart News contributor, and editor of which politically conservative American news aggregation website?','Charles Hurt is the editor-in-chief of the politically conservative American news aggregation website called \'Breitbart News\'.'),(5497,'What American politician from Tennessee born December 13, 1943 is related to former United States Congressman Harold Ford Jr. as well as former Congressman Harold Ford Sr.','The American politician from Tennessee born December 13, 1943 who is related to former United States Congressman Harold Ford Jr. as well as former Congressman Harold Ford Sr. is James R. Cooper, a former U.S. Representative from the state of Tennessee. James R. Cooper is the uncle of both Harold Ford Jr. and Harold Ford Sr.'),(5498,'When was the band who composited \'Discipline\' formed?','The band who composed \'Discipline\' is King Crimson, and the original formation began in 1968. The band has undergone various lineup changes throughout the years, but they are still active and touring today. \'Discipline\' was one of the tracks that appeared on their album of the same name, which was released in 1981.'),(5499,'What group of people are described as semi-nomadic and speak the Semitic language ? ','The group of people described as semi-nomadic and speak the Semitic language are the Bedouins.'),(5500,'Glenn Quagmire is voiced by the creator of what 2012 film?','Glenn Quagmire, a character from the animated television show \'Family Guy,\' is voiced by actor and writer Seth MacFarlane. The 2012 film that Seth MacFarlane created and directed was \'Ted,\' a comedy about a man and his foul-mouthed, stuffed teddy bear.'),(5501,'Are both The Day the Universe Changed and Lennon or McCartney American documentary short films?','No, both \'The Day the Universe Changed\' and \'Lennon or McCartney\' are not American documentary short films. \'The Day the Universe Changed\' is a British TV series that aired in 1985, while \'Lennon or McCartney\' is a Canadian short documentary film released in 2014.'),(5502,'Which European based oil giant bought the commodities trading arm of J.P. Morgan in 2014?','The European based oil giant that bought the commodities trading arm of J.P. Morgan in 2014 was British Petroleum (BP).'),(5503,'What schools of thought are drawn from in the academic discipline of Hafiz Rashid Khan?','I\'m sorry, but I am unable to provide information about an academic discipline or person named Hafiz Rashid Khan. Could you please provide more context or details about the subject?'),(5504,'What Kenya-based company owns the Tusker beer brand?','The Tusker beer brand is owned by East African Breweries Limited (EABL), a Kenya-based company.'),(5505,'Are 13 Engines and Oingo Boingo both new wave bands?','Yes, both 13 Engines and Oingo Boingo are classified as new wave bands. 13 Engines was a Canadian alternative rock band that emerged in the late 80s and early 90s with a sound heavily influenced by new wave, while Oingo Boingo was an American band that was active from the late 70s until the early 90s that was known for their eclectic new wave sound.'),(5506,'When was Erik Watts\' father born?','Erik Watts\' father was the professional wrestler Bill Wa