s.'),(5755,'How many episodes were there of the TV series where Julianna Margulies had the role of Carol Hathaway ?','Julianna Margulies played Carol Hathaway on the TV series \'ER\' for six seasons, from 1994 to 2000. During that time, she appeared in a total of 134 episodes.'),(5756,'When was  Evelyn Waugh famous work first published ','Evelyn Waugh\'s most famous work, \'Brideshead Revisited\', was first published in 1945.'),(5757,'Kresy, which roughly was a part of the land beyond the so-called Curson Line, was drawn for what reason?','The Curzon Line, also known as the Oder-Neisse Line, was drawn as a result of the Soviet-Polish Border Agreement of 1945. The line was proposed by British Foreign Secretary Lord Curzon in 1920 as a potential border between Poland and the Soviet Union after World War I, but it was not adopted at that time. \n\nAfter World War II, at the Potsdam Conference in 1945, the Allies agreed to the transfer of the Kresy region and other territories from Poland to the Soviet Union. The line was then adjusted to reflect Poland\'s new western border, with Kresy remaining on the Soviet side of the line. This resulted in the displacement of millions of Poles and Ukrainians who had been living in the Kresy region for centuries. Today, the term \'Kresy\' is sometimes used to refer to the lands forcibly annexed by the Soviet Union from Poland in 1945.'),(5758,'What city is the women\'s Vans Triple Crown of Surfing event hosted at?','The women\'s Vans Triple Crown of Surfing event is hosted at Haleiwa on the north shore of Oahu, Hawaii.'),(5759,' Cliburn railway station was a station situated on This railway that  ran between Clifton Junction near Penrith and Kirkby Stephen via what?','Cliburn railway station was situated on the Penrith-Kirkby Stephen railway line.'),(5760,'What is the nationality of the scientist who invented in Tribometer?','The Tribometer was not invented by one specific scientist. It is a type of instrument used to measure fricti