wn of Farindola, Italy.'),(5857,'The Grosvenor Museum takes its name from the family name of a title currently held by whom?','The Grosvenor Museum is named after the Grosvenor family, who are one of the wealthiest and most prominent aristocratic families in the United Kingdom. The current holder of the title of Duke of Westminster and head of the Grosvenor family is Hugh Grosvenor.'),(5858,'Pyotr Verzilov is married to a Russian conceptual artist and what kind of activist?','Pyotr Verzilov is married to Nadya Tolokonnikova, who is a Russian conceptual artist and a member of the feminist punk rock activist group Pussy Riot.'),(5859,'Which genus has more species, Monstera or Cercis?','The Monstera genus has around 50 species, while the Cercis genus has around 10 species. Therefore, Monstera has more species than Cercis.'),(5860,'Lauri Markkanen was traded for which player who was born in Houston?','Lauri Markkanen was involved in a sign-and-trade deal that saw him joining the Cleveland Cavaliers while the Chicago Bulls received Derrick Jones Jr., a 6\'5\' small forward who was born in Chester, Pennsylvania, not Houston.'),(5861,'On what street was the hotel located where the fire happened that ranked one above the MGM Grand fire in severity?','The hotel you\'re referring to is the Stardust Resort and Casino. The fire happened on April 14, 1984, on the Las Vegas Strip in Paradise, Nevada, at 3000 South Las Vegas Boulevard, which is where the Stardust was located.'),(5862,' Who was born earlier, Simone Bolelli or Caroline Wozniacki?','Simone Bolelli was born earlier than Caroline Wozniacki. Simone Bolelli was born on October 8, 1985, while Caroline Wozniacki was born on July 11, 1990.'),(5863,'Ocean Springs School District is located in the city in what Mississippi county?','Ocean Springs School District is located in Jackson County, Mississippi.'),(5864,'Which Indian actress who earned filmfare award for Best female debut in \'Refugee\' acted in K3G movie?','The India