s to feature Sigourney Weaver?','The last of the four Alien films to feature Sigourney Weaver is \'Alien: Resurrection.\''),(6422,'Which Genre of Television did Charles Quinton Murphy act for?','Charlie Murphy was primarily known for his work in the Comedy and Entertainment genre of television. He was a comedian, actor, and writer who was best known for his work on the sketch comedy show \'Chappelle\'s Show.\''),(6423,'The memorial commemorating a 1941 Japanese surprise attack was designed by whom?','The memorial commemorating a 1941 Japanese surprise attack refers to the Pearl Harbor National Memorial in Honolulu, Hawaii, which was designed by architect Alfred Preis.'),(6424,'Who is older, Gabe Saporta or John S. Hall?','John S. Hall is older than Gabe Saporta. John S. Hall was born on August 23, 1960, while Gabe Saporta was born on October 11, 1979.'),(6425,'Where was the Danger Mouse produced U2 album exclusively released? ','The Danger Mouse produced U2 album \'Songs of Innocence\' was exclusively released on September 9, 2014, to all iTunes Store customers at no cost, and it was also available for streaming on iTunes Radio.'),(6426,'What award has both Nicole Kidman and Tom Cuise been given?','Nicole Kidman and Tom Cruise both were awarded the Golden Globe for Best Actor and Best Actress in a Motion Picture Drama for their roles in the movie \'Born on the Fourth of July\' (1989) and \'Moulin Rouge!\' (2001), respectively.'),(6427,'The American comedy film Krystal stars which actor who appeared in numerous films such as \'Contact\', \'Armageddon\', \'The Perfect Storm\', \'Crash\', \'Blades of Glory\', \'Black Hawk Down\', \'Nine Lives\', etc.?','The American actor who appeared in all these films and stars in the American comedy film Krystal is William Fichtner.'),(6428,'What is the start date of this tour that was the third concert tour by an American singer-songwriter and was completed in support of the album Red?','The tour you are referring to is the Red Tou