ectly to inquire about the title of the person who is the Head of the Department of Biological Sciences.'),(6635,'What kind of creative artist was Howell Conant, famed for his work with Grace Kelly?','Howell Conant was a renowned fashion photographer and portraitist who worked extensively with Hollywood legends and fashion icons such as Grace Kelly, Audrey Hepburn, and Elizabeth Taylor. He is particularly well-known for his collaborations with Grace Kelly, with whom he formed a close personal friendship. Conant\'s photographs of Kelly helped to cement her status as a style icon, and his images of her continue to be celebrated for their elegance, glamour, and timeless beauty.'),(6636,'Which tendencies does a group like Uyoku dantai fall under?','Uyoku dantai is a right-wing ultranationalist political movement in Japan. It is best classified as falling under the umbrella of far-right politics. Its ideology places a strong emphasis on nationalism, militarism, and traditional values. It is known to have a history of involvement in violent and controversial activities, including illegal paramilitary activities and hate speech against foreigners and ethnic minorities.'),(6637,'Are Floor Jansen and John McCrea from the same band?','No, Floor Jansen and John McCrea are not in the same band. Floor Jansen is a Dutch singer who is known for being the lead vocalist for the symphonic metal band Nightwish, as well as for her work with other metal bands such as After Forever and ReVamp. John McCrea, on the other hand, is the lead singer and songwriter for the American alternative rock band Cake.'),(6638,'What actress from \'The House of Mirth\' played an FBI agent involved in the cover up of extraterrestrials?','The actress is Gillian Anderson. She played the character Dana Scully in the TV series \'The X-Files\' who was an FBI agent involved in investigating cases related to extraterrestrial life.'),(6639,'Which has more members, Dada or Alt-J?','Currently, Alt-J has more members than Dada. Alt-J is a British indie rock band consisting of four members, while Dada is an American rock band consisting of three members.'),(6640,'Is James Bourne a band member of both McBusted and The Auteurs?','No, James Bourne is not a member of The Auteurs. He is a member of both McBusted and Busted (which is one of the bands that formed McBusted).'),(6641,'What was the first role in television for the actress who played Lindsay Lohan\'s best  friend in the Disney Channel\'s  original movie \'Get a Clue\'?','The actress who played Lindsay Lohan\'s best friend in \'Get a Clue\' is Brenda Song. Her first role on television was in an episode of the show \'Thunder Alley\' in 1994.'),(6642,'The Norse-Gaels language emerged from the intermarriage of the Norsemen and what other ethnic group?','The Norse-Gaels language emerged from the intermarriage of Norsemen (Vikings) and the Gaelic-speaking peoples of Scotland and Ireland.'),(6643,'Gérard Dubois opened the first La Rose Noire in which complex of office towers and hotels in Hong Kong?','Gérard Dubois opened the first La Rose Noire patisserie in the International Finance Centre (IFC) complex of office towers and hotels in Hong Kong.'),(6644,'Toby Scott worked with which American singer born on May 24, 1941?','Toby Scott is an American record producer and audio engineer who worked with many notable artists, including Bruce Springsteen and Bob Dylan. However, I am not certain which American singer born on May 24, 1941 he worked with. Could you please provide more information or context so I can better assist you?'),(6645,'What type of industry does Tony Bill and Flyboys have in common?','Tony Bill is an American film producer, director, and actor, and \'Flyboys\' is a movie that he directed. \'Flyboys\' is an aviation and war film, so the common industry between Tony Bill and \'Flyboys\' would be the film or entertainment industry.'),(6646,'Buck Rogers XXVC is a published campaign setting or a homebrew campaign setting?','Buck Rogers XXVC is a published campaign setting originally created by TSR in the 1990s for the second edition of the Dungeons & Dragons tabletop role-playing game. The setting is based on the classic science fiction character Buck Rogers and is set in the 25th century. However, it is no longer in print and may be difficult to find.'),(6647,'What summit is located in the county who\'s county seat is Helena?','Mount Helena is located in the county that has Helena as its county seat. Mount Helena is a mountain located just to the southeast of the city of Helena in Lewis and Clark County, Montana, United States.'),(6648,'Dutch-born American businessman, Harry Koch, fathered a son born in 1900 that founded which oil refinery firm?','The son of Dutch-born American businessman Harry Koch who founded an oil refinery firm is Fred C. Koch, who founded Koch Industries, a conglomerate involved in various industries including oil refining.'),(6649,'Erskine Academy is located in a village in what county?','Erskine Academy is located in South China, which is in Kennebec County, Maine.'),(6650,'BMW X5 is a mid-size version that was produced alongside which newer model, produced in 2009?','The BMW X6 was produced alongside the mid-size BMW X5 from 2009 onward.'),(6651,'A 2013 Smurfs moving is based on what short story that was originally published in 1820?','The 2013 Smurfs movie is not based on a short story that was originally published in 1820. It is actually the third movie in a series of films based on the popular Belgian comic strip \'The Smurfs,\' created by Peyo in 1958.'),(6652,'What is name of the city in Istanbul which has both Column of the Goths and Gül Mosque?','The name of the city in Istanbul which has both Column of the Goths and Gül Mosque is Sultanahmet.'),(6653,'Which region of Ghana was the city where Akrofuom is located? ','Akrofuom is a town located in the Ashanti Region of Ghana.'),(6654,'Which guitar brand was endorsed by the band centered by Ann and Nancy Wilson?','The band centered by Ann and Nancy Wilson is Heart, and they were endorsed by the guitar brand Gibson for many years.'),(6655,'The person who established the Human Biology journal had released how many publications at his death?','The person who established the Human Biology journal was James V. Neel, and at the time of his death in February 2000, he had published over 600 scientific papers and several books throughout his career, including many articles in Human Biology.'),(6656,'Who wrote the lyrics to the 2016/2017 Australian production that stars Gretel Scarlett as Kathy Selden?','The 2016/2017 Australian production of Singin\' in the Rain that stars Gretel Scarlett as Kathy Selden features lyrics by Arthur Freed and music by Nacio Herb Brown, with additional songs by Betty Comden and Adolph Green.'),(6657,'Juhi Parmar who appears in colors TV\'s high rated mythological show shani which premiered on November 7 2013 was born when?','Juhi Parmar was born on December 14, 1980.'),(6658,'The St. Louis Bay Bridge runs between Bay St. Louis and a city in what county?','The St. Louis Bay Bridge runs between Bay St. Louis and the city of Pass Christian, which is in Harrison County, Mississippi.'),(6659,'IS Universidad de Oriente part of the same public university system as California State University, Dominguez Hills?','No, Universidad de Oriente is not part of the same public university system as California State University, Dominguez Hills. Universidad de Oriente is a public university located in Venezuela, while California State University, Dominguez Hills is a public university located in California, United States.'),(6660,'Was High Times or National Geographic published first?','National Geographic was published first. It was first published in 1888, while High Times was first published in 1974.'),(6661,'How many months apart are Johan Mjällby and Neil Lennon in age?','Johan Mjällby and Neil Lennon are only a few months apart in age. Johan was born on February 9th, 1971, and Neil was born on June 25th, 1971. Therefore, they are around 4 months apart in age.'),(6662,'How many cards can a player choose from to be part of their hand in the card game that was the culmination game of the United States Poker Championship?','The card game that was the culmination game of the United States Poker Championship is Texas Hold\'em. In this game, each player is dealt two private cards (known as hole cards) and then five community cards are dealt face up in the middle of the table. Players can choose to use any combination of their hole cards and the community cards to create the best possible hand of five cards. So, technically a player can choose from 7 cards (2 hole cards and 5 community cards) to form their hand.'),(6663,'By how many points did Dion Lewis\' team trail by, in the third quarter, of the Super Bowl that they won ? ','Dion Lewis\' team, the New England Patriots, trailed by 25 points, 28-3, in the third quarter of Super Bowl LI, which they won in overtime against the Atlanta Falcons.'),(6664,'What is the name of a Sri Lankan political party associated with the aim of developing a national identity based on shared characteristics and preserving the nation\'s culture?','The name of the Sri Lankan political party associated with the aim of developing a national identity based on shared characteristics and preserving the nation\'s culture is the Sri Lanka Freedom Party (SLFP). The party was founded in 1951 by S.W.R.D. Bandaranaike and has since played a prominent role in Sri Lankan politics, advocating for policies that seek to promote national unity and cultural preservation.'),(6665,'In what category did the composer of \'Elliot, a Soldier\'s Fugue\' win a Tony Award in 2008?','The composer of \'Elliot, a Soldier\'s Fugue\' is Quiara Alegría Hudes. However, \'Elliot, a Soldier\'s Fugue\' itself did not win a Tony Award in 2008. Quiara Alegría Hudes won a Tony Award in 2008 for Best Book of a Musical for \'In the H