as fever, chills, loss of appetite, nausea, muscle pains, and headaches, and has a chance of causing liver damage?','The viral disease you\'re referring to is likely Hepatitis, a condition that can be caused by different types of viruses, such as Hepatitis A, B, C, D, or E. Each type of virus belongs to a different genus, including Hepatovirus (Hepatitis A virus), Orthohepadnavirus (Hepatitis B virus), Hepacivirus (Hepatitis C virus), Deltavirus (Hepatitis D virus), and Hepevirus (Hepatitis E virus).'),(6680,'What profession did Willi Forst and Elmer Clifton share?','Willi Forst and Elmer Clifton were both film directors. Willi Forst was an Austrian actor, director, and screenwriter who made several notable films during the 1930s and 1940s. Elmer Clifton was an American film director who directed over 250 films, mostly in the silent era.'),(6681,'MacBook offers what brand-type of displays that are higher-resolution than other portable computers?','MacBook offers Retina displays, which have higher resolution than other portable computers. Retina displays have a pixel density that is so high, the human eye cannot distinguish individual pixels from a normal viewing distance, resulting in exceptionally sharp and detailed images.'),(6682,'What famous composer leveraged microtonal music and unconventional methods of musicianship to create his contemporary reknown?','One famous composer who leveraged microtonal music and unconventional methods of musicianship to create his contemporary renown was Harry Partch. He developed his own tuning system and created unique instruments to play his complex rhythms and melodies. Partch\'s music is often experimental and combines elements of various genres, such as classical music, jazz, and world music.'),(6683,'Which film is older, Monsters, Inc. or Earth?','\'Earth\' is not a film, it is a planet. However, if you are referring to a specific movie, I need more information to provide an accurate answer. Assuming you are referring to the 2009 documentary film \'Earth,\' then \'Monsters, Inc.\' is the older film as it was released in 2001.'),(6684,'Who did the actor who played a bellhop in Dead Heat on a Merry-Go-Round play in Star Wars?','The actor who played the bellhop in \'Dead Heat on a Merry-Go-Round\' is Michael Constantine. Michael Constantine did not appear in any \'Star Wars\' films.'),(6685,' Chun Woo-hee\'s notable films include a South Korean horror film about  a policeman who investigates a series of mysterious killings and what?','Chun Woo-hee\'s notable films include The Wailing, a South Korean horror film about a policeman who investigates a series of mysterious killings, and Han Gong-ju, a drama film about a high school girl who is forced to change schools after a traumatic incident.'),(6686,'The musician who did \'Khalaara\' was born on what date?','I\'m sorry, but I don\'t have enough information to answer your question. Can you please provide me with the name of the musician you are referring to?'),(6687,'What city is home to the private research university Jung Seul-ki swam for?','I\'m sorry, but I do not have enough information to identify the specific private research university that Jung Seul-ki swam for. Can you please provide more context or details?'),(6688,'What building in the capital of city of Brandenburg has a roof that is 1 m bigger than the roof of the Der Oderturm? ','I\'m sorry, but I cannot provide a specific answer as there are several buildings in the capital of Brandenburg, Germany, and I do not know which one you are referring to. Could you please provide more specific information or context about the building you are referring to?'),(6689,'During which months of the year does the goalkeeper for Bengaluru FC play? ','As an AI language model, I don\'t have access to the current roster of Bengaluru FC to determine the exact months of when their goalkeeper plays. However, Bengaluru FC typically plays in the Indian Super League (ISL) season, which usually runs from November to March. So, the goalkeeper for Bengaluru FC is likely to play during this period.'),(6690,'Dulce Maria García Rivas took part in a \'Mask vs. Hair\' match with which female wrestler at Guerra de Titanes?','Dulce Maria García Rivas, who is also known as Sexy Dulce, took part in a \'Mask vs. Hair\' match with female wrestler Lady Shani at Guerra de Titanes in 2019. Lady Shani was able to defeat Sexy Dulce and as per the stipulation of the match, Sexy Dulce had to unmask and reveal her true identity to the audience.');
INSERT INTO `devset` VALUES (6691,'My Neighbor Totoro was produced by a Japanese animation film studio founded in what year?','My Neighbor Totoro was produced by Studio Ghibli, a Japanese animation film studio founded in 1985 by directors Hayao Miyazaki, Isao Takahata, and producer Toshio Suzuki.'),(6692,'Which The Wind\'s Twelve Quarters story depicts a summer festival in the utopian city of Omelas?','The story that depicts a summer festival in the utopian city of Omelas is \'The Ones Who Walk Away from Omelas\'. It is a philosophical and thought-provoking story that explores the theme of the moral dilemma of sacrificing the happiness of one child for the happiness of an entire community.'),(6693,'Mazda\'s Mazda6 belongs to which country\'s car manufacturer?','Mazda\'s Mazda6 belongs to Japan\'s car manufacturer Mazda Motor Corporation.'),(6694,'What Was the name of Juan Manuel Márquez\'s  WBO champion holding younger brother?','Juan Manuel Márquez\'s younger brother who held the WBO championship was named Rafael Márquez.'),(6695,'Droga5 has done advertising for an American fashion designer who is the founder of what besides Ecko Unlimited?','Droga5 has done advertising for Marc Ecko, who is the founder of Complex magazine in addition to Ecko Unlimited.'),(6696,'Cudjoe Kazoola Lewis was brought illegally to the United States on board a ship that was how many feet long?','Cudjoe Kazoola Lewis was brought illegally to the United States aboard a ship that was approximately 86 feet long, named the Clotilda, which was the last known slave ship to arrive in the United States in 1860.'),(6697,'In what city was the song \'Where is Love\' first staged and did Oliver Twist meet the Artful Dodger?','\'Where is Love?\' is a song from the musical \'Oliver!\', which was first staged in London in 1960. In the story, Oliver Twist does meet the Artful Dodger, a pickpocket and member of Fagin\'s gang of thieves. The Artful Dodger introduces Oliver to Fagin, who takes the young boy under his wing and teaches him how to pick pockets.'),(6698,'Edward Fitzalan-Howard, 18th Duke of Norfolk is the son of what British Army general and peer','Edward Fitzalan-Howard, 18th Duke of Norfolk is the son of Miles Fitzalan-Howard, 17th Duke of Norfolk, who was a British Army general and peer.'),(6699,'Mother and daughter duo Indian actresses appear in which type of films','There are many mother and daughter duos in the Indian film industry who have appeared in a variety of films, ranging from romantic dramas to action thrillers. Some of the most popular genres include family dramas, romantic comedies, and social-issue-based films. Some notable mother-daughter duos in Indian cinema include Tanuja and Kajol, Hema Malini and Esha Deol, Sharmila Tagore and Soha Ali Khan, and Dimple Kapadia and Twinkle Khanna.'),(6700,'Which breed of dog is extinct, the Hawaiian Poi Dog or the Dandie Dinmont Terrier?','The Hawaiian Poi Dog is the breed that is extinct. The Dandie Dinmont Terrier is still in existence.'),(6701,'Who was an American cartoonist and publisher who had Fred Carter working for him?','That would be Robert Crumb, an American cartoonist and publisher who is known for his influential work in the underground comix movement. Fred Carter was one of the artists who worked for him.'),(6702,'What tower house near Aberchirder, Aberdeenshire did David Gregory inherit?','David Gregory, a Scottish astronomer, inherited the tower house of Kinairdy near Aberchirder, Aberdeenshire.'),(6703,'Which restaurant was founded first, Papa Murphy\'s or Gino\'s Pizza and Spaghetti?','Gino\'s Pizza and Spaghetti was founded first. It was founded in 1957 in West Virginia, while Papa Murphy\'s was founded in 1981 in Hillsboro, Oregon.'),(6704,'Why I Write was penned by which English novelist and critic?','\'Why I Write\' was written by George Orwell, an English novelist and critic best known for his dystopian novel \'1984\' and satirical novella \'Animal Farm.\''),(6705,'Where was the Super Bowl, that Alan Faneca won, played ?','Alan Faneca won Super Bowl XL in 2006 with the Pittsburgh Steelers. The game was played at Ford Field in Detroit, Michigan, United States.'),(6706,'What type of word play does \'What Are Little Girls Made Of?\' and \'What Are Little Boys Made Of?\' have in common?','\'What are Little Girls Made Of?\' and \'What are Little Boys Made Of?\' are both nursery rhymes that use wordplay through a series of contrasting images. \n\nThe rhymes both start with the question \'What are little girls/boys made of?\' and then go on to list various items that are traditionally associated with the gender in question. \n\nFor example, \'What are little girls made of? Sugar and spice and all things nice.\' This contrast between sweet (sugar) and spicy (spice) creates a playful and memorable rhyme. \n\nSimilarly, \'What are little boys made of? Snips and snails and puppy dogs\' tails.\' This time, the contrast is between cute (puppy dogs) and gross (snails), which also creates a memorable and playful rhyme.'),(6707,'What is the name of the historic figure whom participated in surveying the borders of the District of Columbia and had a premier African American recreation center named after him?','The historic figure is Benjamin Banneker. The recreation center named after him is the Benjamin Banneker Community Center, located in the District of Columbia.'),(6708,'The music magazine launched by Rob Stone and Jon Cohen that interviewed CupcakKe about her album Audacious in September was the first print publication to be released where?','The music magazine launched by Rob Stone and Jon Cohen that interviewed CupcakKe about her album Audacious in September was the first print publication to be released on Genius.'),(6709,'What is the name of the third act in a play where a character named Carlo Gérard is partly based on a revolutionary figure?','The name of the third act in the play where a character named Carlo Gérard is partly based on a revolutionary figure might differ depending on the play you are referring to. Could you please provide me with the name of the play so that I can give you an accurate answer?'),(6710,'In which European language is \'Olympischerer\' an adjective?','\'Olympischerer\' is a comparative adjective in German. It means \'more Olympic.\''),(6711,'On which 2012 American military science fiction action film, directed by Peter Berg, did Jason Snell work? ','Jason Snell worked on the 2012 American military science fiction action film \'Battleship\', directed by Peter Berg.'),(6712,'Who directed the film that had \'The Distance\' in the soundtrack?','\'The Distance\' by Cake was featured in the soundtrack of the 1999 film \'Austin Powers: The Spy Who Shagged Me\'. However, the director of the film is Jay Roach.'),(6713,'Barbara Streisand\'s 34th album Partners features a duet with which of her children?','Barbara Streisand\'s 34th album Partners features a duet with her son Jason Gould. The duet is called \'How Deep Is the Ocean\'.'),(6714,'What is the population of the city as of the 2010 Census where the band Quincy Mumford & The Reason Why is based?','I\'m sorry, I am an AI language model and do not have access to current information. However, according to the 2010 census, there are a number of cities/towns called Quincy in the United States. Could you please provide more information on the state or specific location?'),(6715,'Which director, Christopher Guest or Elem Klimov, is known for writing, directing and starring in his movies?','Christopher Guest is known for writing, directing and starring in his movies. He has directed films such as \'This Is Spinal Tap\', \'Waiting for Guffman\', \'Best in Show\', \'A Mighty Wind\', and \'For Your Consideration\'. On the other hand, Elem Klimov was a Soviet film director, but he was not known for starring in his own films. He directed notable movies such as \'Come and See\' and \'Rasputin\'.'),(6716,'What do a Flaming beverage and a Gin and tonic have in common?','A flaming beverage and a gin and tonic both contain alcohol. A flaming beverage is typically made by igniting a high-proof alcohol and then extinguishing the flame before consuming, while a gin and tonic is made by mixing gin and tonic water with ice and a garnish. Both can be enjoyed as cocktails at a bar or at home.'),(6717,'The thid episode of the first season of The Simpsons, features which character voiced by Harry Shearer?','Harry Shearer voiced several characters in the third episode of the first season of The Simpsons, titled \'Homer\'s Odyssey\'. Specifically, he voiced Mr. Burns, Smithers, and the news announcer.'),(6718,'Oak Beach, New York and Great South Bay are both situated between what same island?','Oak Beach, New York and Great South Bay are both situated between Long Island, New York.'),(6719,'Which is a beauty magazine, Allure or Claudia?','Allure is a beauty magazine that features articles and tips on makeup, skincare, haircare, and other beauty-related topics. Claudia is a fashion magazine that covers fashion, beauty, health, and lifestyle.'),(6720,'How many years in prison did the Norfolk farmer defended by Anthony Scrivener serve?','The Norfolk farmer defended by Anthony Scrivener was Tony Martin. He was sentenced to life imprisonment for the murder of a burglar and served 3 years in prison before his sentence was reduced to manslaughter and he was released.'),(6721,'Who is the cofounder of Big Gates Records that collaborated with DJ Khaled on his second album “We the Best”?','The co-founder of Big Gates Records who collaborated with DJ Khaled on his second album \'We the Best\' is Plies.'),(6722,'Jeff Perry the current star of the ABC political drama Scandal is in an upcoming thriller direct by who?','I\'m sorry but I don\'t have access to the latest information or news. Can you please provide me with the name of the upcoming thriller so I can try to find the answer for you?'),(6723,'On what continent is the business port that was struck by one of its worst typhoons in history on 2 September 1937?','The business port that was struck by one of its worst typhoons in history on 2 September 1937 is located in Asia. The port is called Hong Kong and it is located in the southeastern part of China.'),(6724,'Does Frank Pepe Pizzeria Napoletana or Donatos Pizza have more locations?','Donatos Pizza has more locations compared to Frank Pepe Pizzeria Napoletana. As of 2021, Donatos Pizza has over 160 locations in 10 states in the United States, while Frank Pepe Pizzeria Napoletana has 12 locations in the northeast region of the United States.'),(6725,'What event in 1920 was established by the director of the play \'The Miracle?\'','The event established by the director of the play \'The Miracle\' in 1920 was the \'Tony Awards\'. The director, Brock Pemberton, created the award as a way to honor excellence in the theatre industry. The first Tony Awards ceremony was held in 1947 and has since become one of the most prestigious awards in the entertainment industry.'),(6726,'Which tennis player is older out of John Peers and Simone Bolelli?','Simone Bolelli is older than John Peers. Bolelli was born on October 8, 1985 while Peers was born on July 25, 1988.'),(6727,'Where is the investment firm that acquired TI Automotive in 2015 headquartered?','The investment firm that acquired TI Automotive in 2015 is headquartered in London, United Kingdom. The firm is called Bain Capital.'),(6728,'Back Up n da Chevy was an album by the rap group from what city?','Back Up n da Chevy is an album by the rap group named \'Cool Breeze\' from Atlanta, Georgia. The album was released in 1998.'),(6729,'What flag features 13 stars, and has a creator who also has a memorial bridge named after her connecting Pennsylvania and New Jersey?','The flag is the Betsy Ross flag, also known as the \'13-star flag\'. Betsy Ross was a seamstress who lived in Philadelphia and is believed to have sewn the first American flag in 1777. There is also a Betsy Ross Bridge that spans the Delaware River connecting Pennsylvania and New Jersey.'),(6730,'What city is the army division that conducted Operation Blue Hearts in the Korean War based out of?','Operation Blue Hearts was conducted during the Korean War by the US Army\'s 1st Cavalry Division. The 1st Cavalry Division is based out of Fort Hood, Texas, in the United States.'),(6731,'\'The Chance of a Lunchtime\' is an episode of a BBC sitcom writtem by who?','\'The Chance of a Lunchtime\' is an episode of the popular BBC sitcom \'Only Fools and Horses\'. It was written by John Sullivan.'),(6732,'Which aired first, Life After People or Werner Herzog Eats His Shoe?','Werner Herzog Eats His Shoe aired first in 1980, while Life After People premiered in 2009.'),(6733,'The series of novels that reference numerous locations and incorporates themes from multiple genres is titled what?','The series of novels that reference numerous locations and incorporates themes from multiple genres is called a \'multi-genre series\' or a \'genre-blending series\'. Some examples of multi-genre series include Stephen King\'s The Dark Tower series and Diana Gabaldon\'s Outlander series.'),(6734,'Double Dragon starred the actor and martial artist who played which character in \'Brotherhood of the Wolf\'?','The actor and martial artist who starred in Double Dragon and also played a character in \'Brotherhood of the Wolf\' is Mark Dacascos.'),(6735,'The winner of the 1984 United States Senate election in Maine took on what political role from 1997-2001?','The winner of the 1984 United States Senate election in Maine was William Cohen. He went on to serve as the United States Secretary of Defense from 1997 to 2001 under President Bill Clinton.'),(6736,'What award did both Victor Heerman and Lloyd Corrigan win?','Victor Heerman and Lloyd Corrigan both won the Academy Award for Best Writing, Adaptation for the film \'The Story of Louis Pasteur\' in 1937.'),(6737,'Get Off is an album by a group using which style originating in NYC in the early 1970s?','\'Get Off\' is an album by the group called \'Foxy,\' which was known for playing music using the disco style originating in New York City in the early 1970s.'),(6738,'What past honoree from the New Dramatists Organization is a powerful baritone who won the Tony Award for Best Actor in 2000?','The honoree from the New Dramatists Organization who is a powerful baritone and won the Tony Award for Best Actor in 2000 is Brian Stokes Mitchell.'),(6739,'\'Let\'s Get Ready to Rhumble\' is a 1994 song by a music duo from where?','\'Let\'s Get Ready to Rhumble\' is a 1994 song by the UK music duo Ant & Dec (formerly known as PJ & Duncan).'),(6740,'The Schumann–Runge bands are named for at least one German what?','The Schumann-Runge bands are named after Carl Schumann, a German physicist and Walter Runge, a German physicist and mathematician who independently first described the electronic transitions that are responsible for these bands in the Earth\'s atmosphere.'),(6741,'Don Swayze was one of five children.  His older brother was trained in dance by their mother, Patsy Swayze, leading to his role in \'Dirty Dancing\'.  Who is his older brother?','Don Swayze\'s older brother who was trained in dance by their mother and starred in the movie \'Dirty Dancing\' is Patrick Swayze.'),(6742,'Between Joe Orton and Henry James, which author is the adjective \'Ortonesque\' used to refer to his work?','The adjective \'Ortonesque\' is used to refer to the work of Joe Orton.'),(6743,'Rainforest Ecological Train runs through a national park with an area of how many Kilometers ?','I\'m sorry, I don\'t have enough information to answer your question accurately. Can you please provide me with the name of the national park or any additional details?'),(6744,'Who is the player that is Dutch who was the head of the Arsenal Football Club?','The Dutch player who was the head of the Arsenal Football Club is Dennis Bergkamp. Although he was not the head of the club as a whole, he was an assistant coach at Arsenal under manager Arsene Wenger from 2013-2017. Bergkamp is considered one of the greatest players in the club\'s history and was a part of their legendary \'Invincibles\' team that went unbeaten during the 2003-2004 Premier League season.'),(6745,'Between Mike Muir and Paul Di\'Anno, who has worked with more bands?','Mike Muir has worked with more bands than Paul Di\'Anno. Mike Muir is the founder and frontman of the punk band Suicidal Tendencies and has also collaborated with other bands such as Infectious Grooves, No Mercy, and Los Cycos. Paul Di\'Anno is best known as the first lead vocalist of the heavy metal band Iron Maiden, but he has not worked with as many bands as Mike Muir.'),(6746,'Where was one of Sergei Prokofiev\'s most well-known operas first performed in 1921?','One of Sergei Prokofiev\'s most well-known operas, \'The Love for Three Oranges,\' was first performed on December 30, 1921 at the Chicago Civic Opera.'),(6747,'How many films were directed by the director of Wise Blood?','\'Wise Blood\' was directed by the American filmmaker John Huston. He directed a total of 37 feature films throughout his career, with \'The Maltese Falcon,\' \'The Treasure of the Sierra Madre,\' and \'The African Queen\' being among his most famous works.'),(6748,'In what county is the community, to which the character Everett Turner is travelling to in the book \'Away West\', located?','The community to which Everett Turner is traveling to in the book \'Away West\' is not specified, so I can\'t answer that question with a specific county. The book takes place in the western United States during the mid-1800s.'),(6749,'Who is Colin Kaepernick and what is his preferred nickname?','Colin Kaepernick is a former professional American football quarterback who played in the National Football League (NFL). He gained widespread public attention for protesting against police brutality and racial inequality by kneeling during the national anthem before NFL games. His preferred nickname is \'Kap.\''),(6750,'Welcome to Nollywood and Out of the Shadow are both what?','Both \'Welcome to Nollywood\' and \'Out of the Shadow\' are documentary films. \'Welcome to Nollywood\' is a 2007 documentary that explores the Nigerian film industry, while \'Out of the Shadow\' is a 2017 documentary that sheds light on the experience of mental illness and the stigma surrounding it.'),(6751,'Which body of water required more intensive man made barriers the Dundee Canal or Lake Worth Lagoon?','Lake Worth Lagoon required more intensive man-made barriers as it is a shallow, tidally influenced estuary that is susceptible to flooding from hurricanes and storm surges. The lagoon is a protected natural resource, and the construction of man-made barriers such as seawalls, levees, and canals is necessary to maintain its ecological health and to protect adjacent properties and infrastructure from flood damage. The Dundee Canal, on the other hand, is a much smaller artificial waterway that does not require as extensive of man-made barriers.'),(6752,'What did the person in which the Toronto Pearson International Airport is named in honour of organize to win the Nobel Peace Prize?','The person in which the Toronto Pearson International Airport is named in honour of, Lester B. Pearson, organized the first United Nations Emergency Force to resolve the Suez Canal Crisis in 1956. As a result of his work, he was awarded the Nobel Peace Prize in 1957 for his efforts to resolve international conflicts through diplomacy.'),(6753,'Timothy J. Sloan was the CEO of Wells Fargo who succeeded the CEO who took the job in what month?','Timothy J. Sloan succeeded John Stumpf as CEO of Wells Fargo in October 2016 after Stumpf resigned.'),(6754,'In what year was the singer who popularized \'I\'ll Keep the Lovelight Burning\' born?','\'I\'ll Keep the Lovelight Burning\' is a popular song written by Jimmy Kennedy and Nat Simon. It was made famous by British singer Anne Shelton. Anne Shelton was born on November 10, 1923, in Dulwich, London, England.'),(6755,'What was the codename for the atomic bomb that is dropped by someone other than the weaponeer Frederick Ashworth?','The codename for the atomic bomb that was dropped by someone other than the weaponeer Frederick Ashworth was \'Fat Man.\''),(6756,'The Hip Hop Republican was credited with giving blacks emphasizing traditionalism and capitalism a sense of community during which presidential election?','The Hip Hop Republican movement began gaining prominence during the 2008 presidential election, in which Republican nominee John McCain faced off against Democratic nominee Barack Obama.'),(6757,'What band did both Delores Holmes and an inductee to the Rock and Roll Hall of Fame sing in?','Dolores Holmes was a member of the group The Jaynetts, known for their hit single \'Sally Go Round the Roses.\' The inductee to the Rock and Roll Hall of Fame who sang with The Jaynetts was Ellie Greenwich, who provided backing vocals for the group. Greenwich was inducted into the Rock and Roll Hall of Fame in 2010 as a non-performer for her songwriting contributions to the genre.'),(6758,'The actor that plays Phileas Fogg in \'Around the World in 80 Days\', co-starred with Gary Cooper in a 1939 Goldwyn Productions film based on a novel by what author?','The actor who played Phileas Fogg in the 1956 film \'Around the World in 80 Days\' is David Niven. He co-starred with Gary Cooper in the 1939 film \'Beau Geste,\' which was based on a novel by the same name by British author P. C. Wren.'),(6759,'Jacques Coghen is a direct ancestor to the spouse of which Belgian Queen?','Jacques Coghen is a direct ancestor of Belgian Queen Mathilde, who is married to King Philippe of Belgium.'),(6760,'When was the star of the 1982 remake of The Spider\'s Web appointed to Dame Commander of the Order of the British Empire (DBE)?','Glenda Jackson, who was the star of the 1982 remake of The Spider\'s Web was appointed to Dame Commander of the Order of the British Empire (DBE) in 2018 for her services to drama.'),(6761,'When did the mother of Joseph Ferdinand Leopold of Bavaria die?','The mother of Joseph Ferdinand Leopold of Bavaria was Maria Ludovika of Austria-Este. She died on December 18, 1816.'),(6762,'The actress known for her role in \'Lost in Translation\' also appears in Untitled Avenger film with which male actor who plays the character Thor?','The actress known for her role in \'Lost in Translation\' is Scarlett Johansson, who appears in the Untitled Avenger film with Chris Hemsworth, who plays the character Thor.'),(6763,'What king was the intended victim of the plot that Thomas Arundell was briefly suspected of being a part of the same year he became the 1st Baron Arundell of Wardour?','The intended victim of the plot that Thomas Arundell was briefly suspected of being a part of in the same year he became the 1st Baron Arundell of Wardour was King James I of England. The plot was known as the Bye Plot, and it aimed to kidnap the king and force him to revoke some of the anti-Catholic laws. However, Arundell was eventually found not guilty of involvement in the plot.'),(6764,'In what town is the university which the Bryant Bulldogs represent?','The Bryant Bulldogs represent Bryant University, which is located in Smithfield, Rhode Island.'),(6765,'The King who opened Newcastle Civic Center in 1968 was born in what year?','The King who opened Newcastle Civic Center in 1968 was King Olav V of Norway. He was born on July 2, 1903.'),(6766,'Electoral district of Bragg currently includes which suburb in the city of Burnside, Adelaide?','The electoral district of Bragg includes the suburbs of Beaumont, Burnside, Erindale, Hazelwood Park, Stonyfell, Teringie, and Wattle Park, all located in the city of Burnside, Adelaide.'),(6767,'Midland F1 Racing was a racing team that, in 2007, competed under what name for sponsorship reasons?','Midland F1 Racing was acquired by Spyker Cars towards the end of the 2006 season and started competing under the name Spyker F1 for sponsorship reasons in 2007.'),(6768,'What anchor store in the Stratford Square Mall has 728 department store locations in the continental United States?','The anchor store in Stratford Square Mall that has 728 department store locations in the continental United States is JCPenney.'),(6769,'What was the previous name of the Italian town that is about 15 kilometres from a former Cistercian monastery?','I\'m sorry, but without more specific information or context, it is impossible to accurately answer your question. Could you please provide more details or clarify your question?'),(6770,'Which film was Shannyn Sossamon in that was directed by Michael Lehmann?','Shannyn Sossamon starred in the 2001 film \'40 Days and 40 Nights\' that was directed by Michael Lehmann.'),(6771,'What was built near the residential neighborhood of Ramsay, Calgary in 1983?','In 1983, the Calgary Fire Department Station No. 6 was built near the residential neighborhood of Ramsay in Calgary, Alberta, Canada.'),(6772,'When did the man for whom St Vincents Hall, Grantham was built found his eponymous company?','The man for whom St Vincent\'s Hall, Grantham was built is William Fane De Salis. The company he founded was De Salis Studio Equipment Ltd, which was established in 1947.'),(6773,'Arbutus and Aspidistra are what types of plants?','Arbutus is a genus of evergreen trees or shrubs in the family Ericaceae, commonly known as the strawberry tree. \n\nAspidistra is a genus of flowering plants in the family Asparagaceae, commonly known as the cast iron plant or iron plant due to its ability to tolerate low light, infrequent watering, and extreme temperatures.'),(6774,'Who was born first, British novelist Doris Lessing or American writer Philip K. Dick?','Philip K. Dick was born first. He was born on December 16, 1928, while Doris Lessing was born on October 22, 1919.'),(6775,'Gül Train is a project of which Eurasian political and economic intergovernmental organization?','The Gülsuyu-Gültepe-FYGG (Fevziye Yıldırım Gülsuyu Gültepe Protection Association) Train is a project initiated by the Organization of the Eurasian Law Enforcement Agencies with Military Status (SELEC), which is an intergovernmental organization that supports cooperation on law enforcement and security issues among its member states.'),(6776,'Which genus has more species: Sarracenia or Butea?','Sarracenia has more species than Butea. \n\nSarracenia is a genus of carnivorous pitcher plants with about 11 species, all of which are native to North America.\n\nButea is a genus of flowering plants in the pea family (Fabaceae) with only one species, Butea monosperma, commonly known as flame of the forest or palash tree, which is found in tropical and subtropical regions of Asia.'),(6777,'Is Ordos City more west than Yangzhong?','No, Ordos City is actually located further east than Yangzhong. \n\nOrdos City is located in the Inner Mongolia Autonomous Region of China, while Yangzhong is a county-level city under the jurisdiction of Zhenjiang City, Jiangsu Province. \n\nIn terms of longitude, Ordos City is located at approximately 109.7813° E, while Yangzhong is located at about 119.8580° E. Therefore, Yangzhong is more to the east compared to Ordos City.'),(6778,'Careers and The Really Nasty Horse Racing Game are both what kind of game?','Careers and The Really Nasty Horse Racing Game are both board games.'),(6779,'Michelle Lewis has written songs for which \'Lizzie McGuire\' actress? ','Michelle Lewis wrote songs for actress Hilary Duff, who played the lead role in the Disney Channel series \'Lizzie McGuire.\''),(6780,'Choi Jun-hong  is best known as a member of a group formed in which year ?','Choi Jun-hong, better known by his stage name Zelo, is best known as a member of the K-pop group B.A.P (Best Absolute Perfect). The group was formed in 2012 under TS Entertainment.'),(6781,'What bluegrass singer provides vocals for a song on the album which was released in September 2013 through PRMD Music?','I\'m sorry, but I do not have enough information to provide a specific answer to your question. Please provide more details or context so I can better understand the question.'),(6782,'Toyota Innova is part of the IMV program along with which light commercial vehicle?','The Toyota Hilux pickup truck is the other light commercial vehicle that is a part of Toyota\'s IMV program alongside the Toyota Innova.'),(6783,'When is the election held for the position former policy director Krishanti \'Krish\' Vignarajah is running in?','Krishanti \'Krish\' Vignarajah is running for Governor of Maryland. The election for Maryland\'s Governor will be held on Tuesday, November 6, 2018.'),(6784,'What award was won by Niels Henrik David Bohr, a Danish physicist who established the Nordic Institute for Theoretical Physics?','Niels Henrik David Bohr won the Nobel Prize in Physics in 1922 \'for his services in the investigation of the structure of atoms and of the radiation emanating from them\'.'),(6785,'The founder of The Covenant, The Sword, and the Arm of the Lord is a close associate of what man responsible for the Oklahoma City bombing?','The founder of The Covenant, The Sword, and the Arm of the Lord, James Ellison, was a close associate of Timothy McVeigh, who was responsible for the Oklahoma City bombing in 1995.'),(6786,'In what city did the 1959 William & Mary Indians football team lose against the #13 Naval Academy?','The 1959 William & Mary Indians Football Team lost against the #13 Naval Academy in Annapolis, Maryland.'),(6787,'Often seen at the Academy Awards pre-show, what is Robin Roberts\'s occupation?','Robin Roberts is a journalist and television broadcaster. She has worked as a co-anchor of ABC\'s \'Good Morning America\' since 2005.'),(6788,'From what nation is the football player who was named Man of the Match at the 2001 Intercontinental Cup?','The football player who was named Man of the Match at the 2001 Intercontinental Cup was Deco, who is from Portugal.'),(6789,'What is the name of the basketball team that trained under assistant coach, Steven Michael Henson at the University of Oklahoma ?','The basketball team that trained under assistant coach Steven Michael Henson at the University of Oklahoma is the Oklahoma Sooners men\'s basketball team.'),(6790,'Which author lived longer, Nelson Algren or Nathanael West?','Nelson Algren lived longer than Nathanael West. Nelson Algren lived from March 28, 1909 to May 9, 1981 whereas Nathanael West lived from October 17, 1903 to December 22, 1940.'),(6791,'How many members does the Tennessee Volunteers football team\'s Conference have?','The Tennessee Volunteers football team is part of the Southeastern Conference (SEC), which has 14 members.'),(6792,'What British rock band released the album Brothers in Arms in 1985 which also featured a song with the same title?','The British rock band that released the album Brothers in Arms in 1985 and also featured a song with the same title is Dire Straits.'),(6793,'Danglemah, New South Wales is between which town and the town on the south-eastern edge of the Northern Tablelands, New South Wales Australia?','Danglemah, New South Wales is located between the towns of Warialda and Bingara in the Northern Tablelands region of New South Wales, Australia.'),(6794,'What 3 countries are part of the legal name of the airline that merged with Braathens in 2004?','The legal name of the airline that merged with Braathens in 2004 was SAS (Scandinavian Airlines System), which represents the countries of Denmark, Norway, and Sweden.'),(6795,'Who played the female lead in a 2007 Indian Telugu film that was an unofficial copy of a remake of Lina Wertmuller\'s 1974 film?','The 2007 Indian Telugu film you are referring to is titled \'Aadavari Matalaku Arthale Verule\' and it starred Trisha Krishnan as the female lead. The film is an unofficial copy of the 2005 Tamil film \'Sundarapandian\' which itself was a remake of the 1974 Italian film \'Swept Away\' directed by Lina Wertmuller.'),(6796,'Are both French Spaniel and Beagle universally recognized breeds?','Yes, both French Spaniel and Beagle are universally recognized breeds by major kennel clubs such as the American Kennel Club (AKC) and the Fédération Cynologique Internationale (FCI).'),(6797,'What river runs near the tidal island of Eilean Tioram?','The river that runs near the tidal island of Eilean Tioram is the River Shiel.'),(6798,'What genre did the writer whose novel was based on \'I\'ll Take Manhattan\' writes?','Judith Krantz, the writer whose novel was based on \'I\'ll Take Manhattan\', primarily wrote romance novels and was best known for her works in that genre. Her other popular novels include \'Scruples\' and \'Princess Daisy\'.'),(6799,'Which of Damon Stoudamire\'s cousins once played college basketball for the University of Kentucky?','Damon Stoudamire\'s cousin who played college basketball for the University of Kentucky is Tony Delk. He played for the Wildcats from 1992 to 1996 and won an NCAA championship with the team in 1996.'),(6800,'William Hodges visited a polar region as part of a voyage, the region is how big?','Without any specific information regarding the polar region visited by William Hodges, it is impossible to accurately determine its size. There are two polar regions on Earth, the Arctic located at the Earth\'s North Pole and the Antarctic located at the Earth\'s South Pole. The Arctic is about 14.05 million square kilometers in size, while the Antarctic is about 14.2 million square kilometers in size.'),(6801,'What is name of the business unit led by Tina Sharkey at a web portal which is originally known as America Online?','Tina Sharkey leads a business unit called \'Brand and Marketing\' at America Online (AOL).'),(6802,'Are Hungry Hungry Hippos and Parcheesi both published by Parker Brothers?','Yes, both Hungry Hungry Hippos and Parcheesi were published by Parker Brothers. Hungry Hungry Hippos was first released in 1978 by Parker Brothers, and Parcheesi was also originally published by Parker Brothers in the late 1800s before being acquired by Hasbro in 1994.'),(6803,'Piers Bizony has written articles for which magazine based in Bristol, UK?','Piers Bizony has written articles for the BBC Sky at Night magazine, which is based in Bristol, UK.'),(6804,'This film is an adaption of a Jacques Offenbach\'s opera that was written by a Hungarian British screenwriter?','The film you are referring to is \'The Tales of Hoffmann\', directed by Michael Powell and Emeric Pressburger. It is indeed an adaptation of Jacques Offenbach\'s opera of the same name, with the screenplay written by the Hungarian-British screenwriter, Emeric Pressburger.'),(6805,'A man who played in the 1986 FIFA world cup played for what team during the 1982 Scottish League Cup Final?','I\'m sorry, I do not have enough information to provide an accurate answer. Can you please provide the name of the player you are referring to?'),(6806,'Who is a guitarist, Saffron or Myles Kennedy?','Myles Kennedy is a guitarist. He is known for his work with bands such as Alter Bridge and Slash\'s backing band, The Conspirators. Saffron is not known for playing guitar, as far as I know.'),(6807,'Which magazine was first published earlier, The Chronicle of Philanthropy or Skeptic?','The Chronicle of Philanthropy was first published earlier than Skeptic. The Chronicle of Philanthropy was first published in 1988, while Skeptic was first published in 1992.'),(6808,'Old Bushmills Distillery was in the process of transitioning from the ownership of the company that had a headquarters in what English city?','Old Bushmills Distillery is located in Northern Ireland, not England. It is owned by the Mexican beverage company, Jose Cuervo.'),(6809,'Which band was formed first, Goldfinger or The Fray?','Goldfinger was formed first in 1994, while The Fray was formed in 2002.'),(6810,'How many children\'s books has the writer of the sitcom Maid Marian and her Merry Men written ? ','The writer of the sitcom Maid Marian and her Merry Men is Tony Robinson, and he has written several children\'s books, including seven books in the \'Knights\' Tales\' series and four books in the \'Worst Children\'s Jobs in History\' series. However, it is unclear how many of these books are directly related to the Maid Marian and her Merry Men franchise.'),(6811,'What is the name of the city 200 km north-west of Sydney, Australia that the Armstrong 500 race was moved to?','The Armstrong 500 race was moved to the city of Bathurst, which is 200 km north-west of Sydney, Australia. The race is now known as the Bathurst 1000 and is still held annually at the Mount Panorama Circuit in Bathurst.'),(6812,'Who was a species of Alerce tree native to the Andes mountains named after?','The species of Alerce tree native to the Andes mountains is named after the German naturalist and explorer Eduard Friedrich Poeppig, and its scientific name is Fitzroya cupressoides var. Poeppigii.'),(6813,' Steven Rattazzi provides the voice for the character of Doctor Byron Orpheus on an animated series created by who?','Steven Rattazzi provides the voice for Doctor Byron Orpheus on the animated series \'The Venture Bros.,\' created by Jackson Publick and Doc Hammer.'),(6814,'What does the brewery that is located in the home of Neuhaus produce?','Without more specific information, it\'s difficult to answer your question accurately. However, there are several breweries named Neuhaus in different locations around the world. If you can provide me with a more specific location or any additional information, I\'ll do my best to help you find the answer you\'re looking for.'),(6815,'These three apps that have similar functionality to Google for Education are compatible with what Microsoft file format?','Since Microsoft has its own suite of productivity apps, including Microsoft Office and Microsoft Teams, the three apps that have similar functionality to Google for Education and are compatible with Microsoft file formats would likely include:\n\n1. OneDrive - this app is compatible with Microsoft file formats, such as Word documents (.docx), Excel spreadsheets (.xlsx), and PowerPoint presentations (.pptx).\n\n2. Microsoft Teams - this app supports collaboration and communication among team members, and it is also compatible with various Microsoft file formats.\n\n3. Office 365 Education - this suite of apps includes Word, Excel, PowerPoint, OneNote, and other productivity tools that are all compatible with Microsoft file formats. \n\nOverall, these three apps can serve as great alternatives to Google for Education and offer compatibility with Microsoft file formats.'),(6816,'Which contributor to the CBS News program \'60 Minutes\' also contributed to The Great American Dream Machine?','The contributor to the CBS News program \'60 Minutes\' who also contributed to The Great American Dream Machine was Andy Rooney.'),(6817,'How many Studio albums did the group that released the debut album The Cactus Al/Bum release in their initial career?','The group that released the debut album The Cactus Al/Bum is the hip hop duo known as 3rd Bass. In their initial career, they released three studio albums: The Cactus Al/Bum (1989), Derelicts of Dialect (1991), and Marauders (1992).'),(6818,'Which music group has the most members, DC Talk, or Manchester Orchestra?','Manchester Orchestra has fewer members than DC Talk. DC Talk is a Christian hip hop/rock group with three core members - TobyMac, Michael Tait, and Kevin Max, while Manchester Orchestra is an American indie rock band with five members - Andy Hull, Robert McDowell, Tim Very, Andy Prince, and Daniel Tichenor.'),(6819,'Lt Col. Stewart Francis Newcombe was a British army officer and associate of a military officerthat was given what title?','Lt Col. Stewart Francis Newcombe was a British army officer who was an associate of T.E. Lawrence, also known as Lawrence of Arabia.'),(6820,'Casino and Culto A La Vida are cocktails, one of which contains Havana Club 7 and what else?','I\'m sorry, but I don\'t have access to the exact ingredients in the drinks at every bar or restaurant. However, a Casino cocktail typically contains Havana Club 7, lime juice, simple syrup, and maraschino liqueur. A Culto A La Vida cocktail is less common and may have different ingredients depending on the bar or restaurant that serves it.'),(6821,'Minneapolis hip hop collective member that released album in 2006?','One notable Minneapolis hip hop collective that released an album in 2006 is Doomtree, which is known for its DIY approach to making music. The group\'s debut album, \'Doomtree,\' was released in 2006 and featured seven members: P.O.S, Dessa, Mike Mictlan, Sims, Paper Tiger, Lazerbeak, and Cecil Otter.'),(6822,'What other name is the Moor Park Mansion known as?','The Moor Park Mansion is also known as the Moor Park or Hertfordshire Golf and Country Club.'),(6823,'Which singer is also a comic book writer, Max Bemis or Robert Palmer?','Max Bemis is a singer and comic book writer, whereas Robert Palmer was a singer, but not known for writing comic books.'),(6824,'Who wrote the 2009 American home invasion horror film which Andrea Roth was known for her role in ','The 2009 American home invasion horror film that Andrea Roth was known for her role in is called \'The Collector\'. The film was directed by Marcus Dunstan and written by Marcus Dunstan and Patrick Melton.'),(6825,'Are Stan Lee and Mark Helprin both comic book writers?','Stan Lee was a comic book writer, editor, publisher, and the former president and chairman of Marvel Comics, best known for co-creating many iconic Marvel characters such as Spider-Man, the X-Men, the Hulk and the Fantastic Four. \n\nMark Helprin, on the other hand, is an American novelist whose work includes fiction and political commentary. He is not known for being a comic book writer.'),(6826,'Are Kim Dong-jun and Charlie Harper both singers?','Kim Dong-jun is a South Korean singer, actor and member of the boy group ZE:A. On the other hand, Charlie Harper is a fictional character portrayed by actor Charlie Sheen in the TV series Two and a Half Men. While the character of Charlie Harper was a jingle writer, he was not known to be a singer in the show.'),(6827,'What New York city is 60 miles northwest of the Glen Iris Inn?','Rochester is the New York city that is 60 miles northwest of the Glen Iris Inn.'),(6828,'Dorothy Sarnoff\'s personal client list included what AMerican novelist, who has sold over 800 million copies of her books?','Dorothy Sarnoff\'s personal client list included American novelist Danielle Steel, who has sold over 800 million copies of her books.'),(6829,'Dean O\'Banion was the main rival of which mobster, known as Scarface?','Dean O\'Banion was the main rival of Al Capone, who was also known as Scarface. O\'Banion was the head of the North Side Gang in Chicago during the Prohibition era, which was involved in bootlegging and organized crime. Capone was the head of the rival Chicago Outfit, and their rivalry led to violent clashes and murders known as the \'Beer Wars.\''),(6830,'Princess Marie-Clementine Bagration was the illegitimate daughter of the Austrian Empire\'s Foreign Minister whose resignation was forced by what?','Princess Marie-Clementine Bagration was the daughter of Prince Alexander of Hohenlohe-Waldenburg-Bartenstein and Princess Elisabeth-Bagration of Moukhrani. Her father, Prince Alexander, served as the foreign minister of the Austrian Empire, but was forced to resign in 1859 over his handling of the Italian War of 1859.'),(6831,'Where is the home of the common party princess voiced by Idina Menzel?','It sounds like you might be talking about a character from a movie or TV show. Can you provide more information or context so I can better understand and assist you?'),(6832,'Were Frank R. Strayer and Krzysztof Kieślowski both Directors?','Yes, Frank R. Strayer and Krzysztof Kieślowski were both directors. Frank R. Strayer was an American film director, screenwriter, and producer, known for his work in the 1930s and 1940s. Krzysztof Kieślowski was a Polish film director and screenwriter, best known for his art-house films such as the Three Colors trilogy.'),(6833,'Which French aristocrat and military officer who fought in the American Revolutionary War visited this historic home located at Enfield, Halifax County, North Carolina, known as The Cellar?','The French aristocrat and military officer who visited The Cellar in North Carolina during the American Revolutionary War was known as Marquis de Lafayette.'),(6834,'What team does the third place winner from the 2006 San Marino Grand Prix currently compete with?','The third-place winner of the 2006 San Marino Grand Prix was Michael Schumacher, who at that time was driving for the Scuderia Ferrari team. However, Michael Schumacher retired from Formula 1 in 2012, and currently, he is not competing with any team.'),(6835,'What is the name of the field marshal and strategist who was the mastermind behind the Schlieffen Plan?','The name of the field marshal and strategist who was the mastermind behind the Schlieffen Plan was Alfred von Schlieffen.'),(6836,'In what year was the aviator in whose honour the Quai d\'Auteuil was renamed born?','The aviator in whose honor the Quai d\'Auteuil in Paris was renamed was Roland Garros. He was born on October 6, 1888.'),(6837,'How many records did the boy band who released \'Said and Done\' sell worldwide as of 2013?','The boy band that released \'Said and Done\' is Boyzone. As of 2013, it was reported that they had sold over 25 million records worldwide.'),(6838,'What is the origin of the name of the neighbourhood in which the building at 359 Broadway is located ?','The building at 359 Broadway is located in the Tribeca neighborhood of Lower Manhattan, New York City. The name \'Tribeca\' is an acronym for \'Triangle Below Canal Street\'. The neighborhood is bounded by Canal Street to the north, West Street to the west, Broadway to the east and Vesey Street to the south. It was named Tribeca in the 1970s by artists and residents seeking to give the neighborhood a unique identity. Prior to this, the area was known as Washington Market, after the large outdoor market that was located there in the 19th century.'),(6839,'Are Grant Nicholas and Danny Shirley both American singers?','No, Grant Nicholas is a Welsh singer and musician who is best known as the lead vocalist and guitarist of the Welsh rock band Feeder, while Danny Shirley is an American country music singer, best known as the lead vocalist of the band Confederate Railroad.'),(6840,'Which mine first entered into production, Beaulieu Mine or Con Mine?','The Con Mine entered into production first, in 1938, while the Beaulieu Mine began production in 1942.'),(6841,'Which mountain, Masherbrum or Khunyang Chhish, is a taller mountain?','Khunyang Chhish is taller than Masherbrum. Khunyang Chhish stands at about 7,785 meters (25,541 ft) while Masherbrum stands at approximately 7,821 meters (25,659 ft).'),(6842,'What was the population at the 2010 census of the city which, along with Clayton, is covered by the Mount Diablo Unified School District?','The city which, along with Clayton, is covered by the Mount Diablo Unified School District is Concord, California. According to the 2010 United States Census, the population of Concord was 122,067.'),(6843,'A writer for The Kenyon Review won a Pulitzer Prize in what year?','The Kenyon Review has had several contributors win the Pulitzer Prize over the years. Could you please tell me the name of the writer you are referring to so I can give you the specific year they won?'),(6844,'Peter Bales and Raphael Holinshed both worked on what project?','Peter Bales and Raphael Holinshed both worked on the project known as \'the Chronicles of England, Scotland and Ireland\'. Holinshed was the main author, while Bales was responsible for transcribing and editing the text. The Chronicles was a monumental work of English history, published in two volumes in 1577 and 1587. It provided a comprehensive account of the history of the British Isles from prehistoric times up to the reign of Queen Elizabeth I.'),(6845,'The actor who starred in \'The Hearse\' gained worldwide film by starring in whose series of 1940s films?','The actor who starred in \'The Hearse\' gained worldwide fame by starring in the series of 1940s films featuring the iconic detective, Charlie Chan. The actor\'s name was Sidney Toler, who portrayed Chan in 11 films.'),(6846,'Sand Mountainis part of the southern tip of a mountain chain in which part of North America ?','Sand Mountain is located in the southern tip of the Appalachian Mountains which extend from central Alabama through the northeastern United States.'),(6847,'Since what historic period has the area known for its Crottin de Chavignol goat cheese been inhabited?','The area known for Crottin de Chavignol goat cheese in France has been inhabited since prehistoric times, as evidenced by archaeological finds such as dolmens and menhirs in the surrounding area. However, the production of Crottin de Chavignol cheese specifically dates back to the Middle Ages, during which time goat farming became popular in the region.'),(6848,'Where is the brand \'Moe\'s Southwest Grill\' owned based?','Moe\'s Southwest Grill is a fast-casual restaurant chain that was founded in December 2000 in Atlanta, Georgia, United States. As of 2021, it has more than 700 locations in the USA and several international locations.'),(6849,'A British sports, health and leisure business hosted the World Games on what dates?','I\'m sorry, but I would need a specific year to answer your question accurately. The World Games are held every four years, and the dates of the event vary from edition to edition. Can you please provide me with the year you are referring to?'),(6850,'Who was the murderer sent to \'Old Smokey\' for allegedly commiting \'The Crime of the Century\'?','Based on the limited information provided, I am unable to determine the specific person you are asking about. Can you please provide more details or context so I can assist you better?'),(6851,'Ella Purnell appeared in this 2014 film loosely based on what fairy tale?','Ella Purnell appeared in the 2014 film called \'Maleficent\', which is loosely based on the fairy tale of Sleeping Beauty.'),(6852,'Which of the former British Leyland companies is best know for it\'s two-seat open sports cars?','The former British Leyland company best known for its two-seat open sports cars is MG (Morris Garages).'),(6853,'How many movies did the \'Comic Book Villains\' star born on march 20,1970 apprear in since the early 1990s?','The actor you are referring to is Michael Jai White. He was born on March 20th, 1970, and he has appeared in more than 80 movies since the early 1990s.'),(6854,'What is this group referred to as that this Russian composer, who wrote \'The Songs and Dances of Death,\' is a member of?','I am sorry, but I need more information to be able to answer your question accurately. Could you please clarify which Russian composer you are referring to and provide more context about the group you are asking about?'),(6855,'Which of the university at which Jack M. Guttentag  is a professor emeritus of finance was established in 1881 through a donation?','Jack M. Guttentag is a professor emeritus of finance at the Wharton School of the University of Pennsylvania, which was established in 1881 through a donation from Joseph Wharton.'),(6856,'What company produced the 1978 movie based on a book written by a radio playwright and children\'s book author born in 1900?','The company that produced the 1978 movie based on a book written by a radio playwright and children\'s book author born in 1900 is Paramount Pictures, and the movie is titled \'The Lord of the Rings.\' The book\'s author is J.R.R. Tolkien.'),(6857,'Orson Scott Card first published his short story \'Killing Children\' in this American science-fiction magazine whose first issue was published when?','Orson Scott Card first published his short story \'Killing Children\' in the American science-fiction magazine Analog Science Fiction and Fact. The first issue of the magazine was published in 1930.'),(6858,'Which crop first domesticated in Mexico has its price regulated by a Mexican parastatal created in 1962?','The crop is maize (corn), and the Mexican parastatal that regulates its price is called CONASUPO (National Company of Popular Subsistence).'),(6859,'Whose father is the name of the son of the chief counsellor to the king in Hamlet taken from?','The name of the son of the chief counselor to the king in Hamlet is Polonius. His father\'s name is not specified in the play, but he is referred to as Polonius throughout the play.'),(6860,'What two singers who worked together on the song I Would Like to See You Again also performed as part of a country music group which was active between 1985 and 1995?','Willie Nelson and Merle Haggard performed as a duo and released the album \'I Would Like to See You Again\' in 1978. They also worked together as part of the country supergroup The Highwaymen along with Johnny Cash and Waylon Jennings, which was active from 1985 to 1995.'),(6861,'What musical was inspired by the films that included Ruth Leuwerik\'s best known role?','The musical that was inspired by the films featuring Ruth Leuwerik\'s best-known role is \'The Sound of Music\'. Ruth Leuwerik played the role of Maria in the German film adaptation of the Rodgers and Hammerstein musical.'),(6862,'Which Kevin Costner movie included an actor who also starred in \'Little Big League\'?','The Kevin Costner movie that included an actor who also starred in \'Little Big