ad as MVP which Hall of Fame class member of 1988?','The 1978 NBA World Championship Series had Wes Unseld as the MVP who was inducted into the Hall of Fame class of 1988.'),(7095,'Who was born first out of Leopold Lummerstorfer and Laurent Touil-Tartour?','I couldn\'t find any information about Leopold Lummerstorfer or Laurent Touil-Tartour online. Could you please provide more context or details about who they are?'),(7096,'In what city did Charlie Spiller play college football?','Charlie Spiller played college football at University of Montevallo in Montevallo, Alabama.'),(7097,'The actor of Professor Sprout in \'Harry Potter\' acted as a mother in a sitcom. In that sitcom, what was the daughter\'s name?','The actress who played Professor Sprout in the \'Harry Potter\' film series is Miriam Margolyes. She played the character of Mrs. Harris in the British sitcom \'The Life and Times of Vivienne Vyle\'. The daughter\'s name in that sitcom is called Alice, played by actress Samantha Spiro.'),(7098,'The town of Sinclair, West Virginia, is named after the founder of the local oil drilling company. What is on Sinclair Oil\'s famous logo?','Sinclair Oil\'s famous logo is a green dinosaur, often referred to as Dino or Dino the Dinosaur. It has been the company\'s mascot since the early 1930s.'),(7099,'In what year was Kasper Schmeichel\'s father born?','Kasper Schmeichel\'s father, Peter Schmeichel, was born on November 18, 1963.'),(7100,'Edwyn Collins and Ian Gillan both have which profession in common?','Edwyn Collins and Ian Gillan are both musicians. Edwyn Collins is a Scottish musician, producer, and songwriter known for his work with the band Orange Juice, as well as for his solo career. Ian Gillan is an English singer and songwriter who is best known as the lead vocalist for the band Deep Purple.'),(7101,'In which year was this American figure skater, actress, and sports commentator coached by Richard Callaghan for Olympic games, the U. S. national champion?','Th