es of the vast array of foods that might have been served at the Hawaiian Cottage.'),(7248,'Fighting Cock is produced in what Kentucky county?','Fighting Cock is produced in Franklin County, Kentucky.'),(7249,'A guitar player called Noodles is a longtime member of which band, The Smashing Pumpkins or The Offspring?','Noodles is a longtime member of The Offspring, an American rock band formed in 1984.'),(7250,'Giselle Cossard was known as Mother Giselle of what type of diety?','Mother Giselle is a character from the video game series Dragon Age. She is known as the Keeper of the Dalish elves, who worship the gods of the elven pantheon, such as Mythal and Andruil. She is also the leader of the College of Enchanters in Orlais, an organization that harnesses the power of magic to benefit society.'),(7251,'How many students were enrolled in American professional bowler Chris Barnes\' high school in the 2010-2011 school year?','I\'m sorry, but I do not have that specific information. However, if you could tell me the name of the high school Chris Barnes attended, I can try to find the enrollment statistics for that school for the 2010-2011 academic year.'),(7252,'Which song did Eminem and Rihanna collaborate on after their other collaboration song in studio album \'Unapologetic?\'','Eminem and Rihanna collaborated on the song \'The Monster\' for Eminem\'s 2013 studio album \'The Marshall Mathers LP 2\' after their previous collaboration on the song \'Love the Way You Lie\' for Rihanna\'s 2010 studio album \'Unapologetic.\''),(7253,'Which player, who also played for the New Jersey Nets and the Golden State Warriors, finished third in the league with 231 three-point field goals during the 1995-96 Atlanta Hawks season?','The player you are referring to is Steve Smith.'),(7254,'Do Chestnut and Arenga trees both grow in the northern hemisphere?','Yes, Chestnut trees and Arenga trees both grow in the northern hemisphere. Chestnut trees are native to temperate regions of the nor